viva, GD & interview skills etc. Further, smart education is facilitator of call centre training, campusing and placements.Everybody knows that learning English is very important in today.', '011.png', NULL, 'welcome-to-smart-education-2', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Active', NULL, NULL, '2021-12-17 16:41:43', '2021-12-17 16:41:43'),
(30, 1, 2, 13, NULL, NULL, 'Team Building', 'Individually we are one drop BUT TOGETHER,we are an OCEAN.', 'Stress Management.png', NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Active', NULL, NULL, '2021-12-17 16:43:31', '2021-12-17 16:43:31'),
(31, 1, 2, 14, NULL, NULL, 'Teaching Process @ Smart Education', 'English learning and speaking is the latest demand of the society. Smart Education is having an out of the box procedure to organize class for each of the students of different ages. Learning English is not to acquire knowledge about grammar or listening dialog in the classroom.Everybody has to know the proper implication and use of the language. Hence only class coaching is not everything to get it acquainted with the language properly it is also necessary to take enough training in the practical field.<span class=\"Gap\"></span>\r\n                    For this reason, Outing Program and Public Facing are two special outdoor classes which have been gaining popularity of Smart Education. However, we have some other methods in our teaching process like learning English with the aid of indoor and outdoor games. Apart from these you will have personalized classes where you are able to do practice with our highly experienced faculties any time.<span class=\"Gap\"></span>\r\n                    We have few electronic devices and tools for self learning system where you have enough opportunity for practice; with this you can easily select your areas of concern and focus on them to rectify it.Voice Recording and Play Back Pronunciation facility in our system will correct your voice and accent. You will be a good orator with command in English after our coaching class and GD practice session and you will find out the secret of communicating with each others.Smart Education not only teaches you how to learn English, it will also groom your personality to dashing and attractive.<span class=\"Gap\"></span>\r\n                    <span class=\"Pre Black\">⚫ <b>Our Course Structure :</b> Introductory Conversation | Speech &amp; Debate | Group Discussion | Personality Development | Public Facing | GK &amp; GI | Basic Grammar | Self introduction | Games with English | Teaching | Quiz | Outing | Communication Skill | Interview Training | Movement | Soft Skill | IPA / MTI | Body Language | Tele Communication | Phonetic Development | Voice Modulation | Conversational English | Computer Literacy | Internet Application | Voice Technology</span>', '021.png', NULL, 'teaching-process-at-smart-education-2', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Active', NULL, NULL, '2021-12-17 16:43:31', '2021-12-17 16:43:31'),
(32, 1, 2, 13, NULL, NULL, 'Campus To Corporate', 'Don’t let what you can’t do stop you from what you can do.', 'Campus To Corporate.png', NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Active', NULL, NULL, '2021-12-17 16:43:31', '2021-12-17 16:43:31'),
(33, 1, 2, 13, NULL, NULL, 'Spoken English', 'Language is a powerful tool,one must know how to use it.', 'Spoken English.png', NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Active', NULL, NULL, '2021-12-17 16:43:31', '2021-12-17 16:43:31'),
