(136, 3, 17, 41, NULL, NULL, 'Our Collage', 'Lalita Barik Memorial Charitable Trust (LBMCT) has given special attention for setting up Primary Teacher Training Institute at Kultikri under Sankrail Block for introducing D.EL.Ed course in Kultikiri Teachers Training Institute of Higher Studies.\r\nThe Trust is ideologically responsible to provide the trainees quality maintenance, professional competence and sound knowledge of pedagogy with the help of our well-experienced faculty, well equipped library, computer and laboratory and modern audio and video programme in addition to the so called class room teaching. The B.Ed. Course is to run under N.C.T.E. norms and recognition (Govt. of India) with affiliation of Vidyasagar University at Midnapur, West Bengal.\r\n\r\nWe would continue to strive for quality and excellence.', 'about.jpeg', NULL, 'gallery-3', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Active', NULL, NULL, '2021-12-17 16:43:31', '2021-12-17 16:43:31'),
(137, 3, 17, 41, NULL, NULL, 'Mission & Vission', 'MISSION\r\nTo establish and run institutions of higher education in teachers’ training for primary and secondary, engineering, technology, management, paramedical, medical and other professional courses with the aim of making the Midnapore a center for education and training to enable the students to pursue careers of their choice and to obviate the need to travel long distances for fulfilling. AACT is currently making endeavor for launching B.Ed course titled  Rishi Aurobindo Institute of Teacher’s Education at Panchkhuri, Paschim Midnapore.\r\nVISION\r\nTo be a leading organization for providing education in the fields of technology, management, medical, paramedical science etc., for the socio-economic development of the region creating centers of excellence in education so as to provide value based education of international standards to all segments of society and to stand by the weaker segments of society..', '', NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Active', NULL, NULL, '2021-12-17 16:43:31', '2021-12-17 16:43:31'),
