(219, 1, 5, 1, NULL, NULL, 'Call Centre/BPO', '<h5 class=\"Details\">A mixed course for <span class=\"Semi-Bold\">Advance Spoken English</span> &amp; Communication Skills.</h5>\r\n<h4><span class=\"Semi-Bold\">Course Duration</span> : 4-6 Months</h4>\r\n<h4><span class=\"Semi-Bold\">Timing</span> : 4 Days In A Week</h4>', '03.png', NULL, 'call-centre-bpo-1', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Active', NULL, NULL, '2021-12-17 16:43:31', '2021-12-17 16:43:31'),
(220, 1, 5, 1, NULL, NULL, 'Kid Section', '<h5 class=\"Details\">We Focuses on developing the four English language skills: Reading, Writing, Listening and Speaking. We build the cornerstones of language, Grammar and Vocabulary, from a young age.</h5>\r\n<h4><span class=\"Semi-Bold\">Course Duration</span> : 4-6 Months</h4>\r\n<h4><span class=\"Semi-Bold\">Timing</span> : 4 Days In A Week</h4>', '03.png', NULL, 'kid-section-1', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Active', NULL, NULL, '2021-12-17 16:43:31', '2021-12-17 16:43:31'),
(221, 1, 5, 1, NULL, NULL, 'Professional Course', '<h5 class=\"Details\">SPOKEN ENGLISH & PERSONALITY DEVELOPMENT COURSE If you are A BUSY PROFESSIONAL and have no time to join full time course, so you can join our professional batch.</h5>\r\n<h4><span class=\"Semi-Bold\">Course Duration</span> : 4-6 Months</h4>\r\n<h4><span class=\"Semi-Bold\">Timing</span> : 4 Days In A Week</h4>', '03.png', NULL, 'professional-course-1', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Active', NULL, NULL, '2021-12-17 16:43:31', '2021-12-17 16:43:31'),
(222, 1, 5, 1, NULL, NULL, 'Bengali & Hindi Medium', '<h5 class=\"Details\">Smart Education offers a wide range of English Language, Soft Skills, Sales & Service and Communication training programs designed to help students and others especially who are from Bengali and Hindi medium realize their true potential and allow them to achieve its goals.</h5>\r\n<h4><span class=\"Semi-Bold\">Course Duration</span> : 4-6 Months</h4>\r\n<h4><span class=\"Semi-Bold\">Timing</span> : 4 Days In A Week</h4>', '03.png', NULL, 'bengali-hindi-medium-1', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Active', NULL, NULL, '2021-12-17 16:43:31', '2021-12-17 16:43:31'),
