(48, 30, 5, 'How to login?', 'Click on the top right Account icon on mobile or \"Account\" on desktop. Click Sign in. Enter your Mobile number without country code(UAE numbers only). You will receive OTP shortly, enter OTP to successfully login. ', ' كومبوزر و السموك و', ' كومبوزر و السموك و  كومبوزر و السموك و  كومبوزر و السموك و  كومبوزر و السموك و  كومبوزر و السموك و', NULL, '2022-07-04 11:40:09', NULL, '2022-09-11 02:00:48'),
(49, 30, 5, 'How to make a purchase?', 'Navigate to the product section that you would like to order from Mawfoor. Click on \'Order now\' to checkout or \'Add to Cart\' to continue shopping. At the Checkout option, you will receive \'Sign in\' to proceed option. Enter your Mobile number to login and follow the instructions. Add your address if not already added. Proceed to choose payment method. You will receive order confirmation SMS and Email if your order has been successfully accepted.', NULL, NULL, NULL, '2022-07-04 13:12:11', NULL, '2022-07-05 16:44:48'),
(51, 30, 7, 'Where are you based?', 'We\'re based in UNITED ARAB EMIRATES', NULL, NULL, NULL, '2022-08-11 17:40:05', NULL, '2022-08-11 17:40:05'),
(52, 30, 7, 'How does shipping work?', 'As soon as we confirm your order, you will receive an order confirmation sms and email.  Our reliable delivery partner collects your order from our warehouse and delivers it to your shipping address as mentioned by you at the time of the order. Delivery Partner may contact you for additional details or information to deliver your package safely without any hassle.', NULL, NULL, NULL, '2022-08-11 17:40:27', NULL, '2022-08-11 17:40:27');

