--
-- Table structure for table `products`
--

CREATE TABLE `products` (
  `id` int NOT NULL,
  `storeId` int DEFAULT NULL,
  `sku` varchar(64) CHARACTER SET utf8mb3 COLLATE utf8mb3_bin DEFAULT NULL,
  `title` varchar(255) CHARACTER SET utf8mb3 COLLATE utf8mb3_bin DEFAULT NULL,
  `slug` varchar(255) CHARACTER SET utf8mb3 COLLATE utf8mb3_bin DEFAULT NULL,
  `url` varchar(255) CHARACTER SET utf8mb3 COLLATE utf8mb3_bin DEFAULT NULL,
  `shortDescription` text CHARACTER SET utf8mb3 COLLATE utf8mb3_bin,
  `description` text CHARACTER SET utf8mb3 COLLATE utf8mb3_bin,
  `searchKeywords` text CHARACTER SET utf8mb3 COLLATE utf8mb3_bin,
  `topNotes` varchar(255) CHARACTER SET utf8mb3 COLLATE utf8mb3_bin DEFAULT NULL,
  `middleNotes` varchar(255) CHARACTER SET utf8mb3 COLLATE utf8mb3_bin DEFAULT NULL,
  `baseNotes` varchar(255) CHARACTER SET utf8mb3 COLLATE utf8mb3_bin DEFAULT NULL,
  `price` decimal(10,2) DEFAULT NULL,
  `specialPrice` decimal(10,2) DEFAULT NULL,
  `specialPriceFrom` date DEFAULT NULL,
  `specialPriceTo` date DEFAULT NULL,
  `bestSellers` enum('yes','no') CHARACTER SET utf8mb3 COLLATE utf8mb3_bin DEFAULT 'no',
  `newArrivals` enum('yes','no') CHARACTER SET utf8mb3 COLLATE utf8mb3_bin DEFAULT 'no',
  `spicey` enum('yes','no') CHARACTER SET utf8mb3 COLLATE utf8mb3_bin NOT NULL DEFAULT 'no',
  `taxClassId` int DEFAULT NULL,
  `weight` varchar(20) CHARACTER SET utf8mb3 COLLATE utf8mb3_bin DEFAULT NULL,
  `isConfigurable` int DEFAULT '0',
  `metaTitle` text CHARACTER SET utf8mb3 COLLATE utf8mb3_bin,
  `metaKey` text CHARACTER SET utf8mb3 COLLATE utf8mb3_bin,
  `metaDescription` text CHARACTER SET utf8mb3 COLLATE utf8mb3_bin,
  `metaImage` varchar(255) CHARACTER SET utf8mb3 COLLATE utf8mb3_bin DEFAULT NULL,
  `optionTitle` varchar(255) CHARACTER SET utf8mb3 COLLATE utf8mb3_bin DEFAULT NULL,
  `optionType` varchar(255) CHARACTER SET utf8mb3 COLLATE utf8mb3_bin DEFAULT NULL,
  `optionValue` varchar(255) CHARACTER SET utf8mb3 COLLATE utf8mb3_bin DEFAULT NULL,
  `color` varchar(255) CHARACTER SET utf8mb3 COLLATE utf8mb3_bin DEFAULT NULL,
  `size` varchar(255) CHARACTER SET utf8mb3 COLLATE utf8mb3_bin DEFAULT NULL,
  `brand` varchar(255) CHARACTER SET utf8mb3 COLLATE utf8mb3_bin DEFAULT NULL,
  `application` text CHARACTER SET utf8mb3 COLLATE utf8mb3_bin,
  `type` varchar(30) CHARACTER SET utf8mb3 COLLATE utf8mb3_bin DEFAULT NULL,
  `fromDate` date DEFAULT NULL,
  `fromTime` varchar(100) CHARACTER SET utf8mb3 COLLATE utf8mb3_bin DEFAULT NULL,
  `toDate` date DEFAULT NULL,
  `toTime` varchar(100) CHARACTER SET utf8mb3 COLLATE utf8mb3_bin DEFAULT NULL,
  `visibility` enum('Not Visible Individually','Catalog') CHARACTER SET utf8mb3 COLLATE utf8mb3_bin DEFAULT 'Catalog',
  `sequence` int DEFAULT NULL,
  `status` enum('active','inactive') CHARACTER SET utf8mb3 COLLATE utf8mb3_bin DEFAULT 'active',
  `inventory` enum('alwaysInStock','manageStock') CHARACTER SET utf8mb3 COLLATE utf8mb3_bin DEFAULT 'alwaysInStock',
  `attr1` varchar(100) CHARACTER SET utf8mb3 COLLATE utf8mb3_bin DEFAULT NULL,
  `attr2` varchar(100) CHARACTER SET utf8mb3 COLLATE utf8mb3_bin DEFAULT NULL,
  `attr3` varchar(100) CHARACTER SET utf8mb3 COLLATE utf8mb3_bin DEFAULT NULL,
  `attr4` varchar(100) CHARACTER SET utf8mb3 COLLATE utf8mb3_bin DEFAULT NULL,
