(1207, 30, 'EXT0002', 'AMBRA CALABRIA EDP 50 ML', 'ambra-calabria-edp-50-ml-25', NULL, 'This is an intriguing and inviting fragrance both for special occasions and daily usage.  A romantic mixture of bergamot and green notes along with sweet amber and vanilla.\r\n', 'Abra Cadabra! Get ready to witness the magical transition of an opening of a romantic mixture of Calabrian bergamot and green notes into sweet amber and vanilla… This unusually fresh, leafy-green amber fragrance is an intriguing and inviting one both for special occasions and daily usage.\r\n', NULL, 'Bergamot, Galbanum, Green Leaves', 'Jasmine, Coriander Seeds', 'Sweet Amber, Musk, Vanilla', '756.00', '0.00', NULL, NULL, 'no', 'no', 'no', NULL, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '6', NULL, 'Simple', NULL, NULL, NULL, NULL, 'Catalog', 220, 'active', 'alwaysInStock', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2022-07-04 14:37:37', NULL, '2022-07-22 11:33:05'),
(1208, 30, 'EXT0024', 'ANI EDP 50 ML', 'ani-edp-50-ml-14', NULL, 'A romantic and calm perfume created under the inspiration of a famous Anatolian folk song called “Sarı Gelin” (in Turkish) or “Sari Gyalin” in Armenian.\r\n', '\"Having been shown by perfume lovers as the best vanilla scent and becoming an iconic scent, highly celebrated ANI is a romantic and calm perfume created under the inspiration of a famous Anatolian folk song called “Sarı Gelin” (in Turkish) or “Sari Gyalin” in Armenian. The similarity of the name of the song in both languages suggests that both nations share a very similar culture as far as art, food or other aspects of life are concerned. ANI is the name of an ancient city that is now known as the Ani Ruins, which was included on UNESCO\'s World Heritage List.\r\n\r\nThe only boundary is in the imagination of the people. This perfume is dedicated to ruining any border between people and empowering the wearer to build his/her own empire even in a situation when all he/she is left with is nothing but ruins.\"\r\n', NULL, 'Bergamot, Green Notes, Blue Ginger, Pink Pepper', 'Blackcurrant, Turkish Rose, Cardamom', 'Patchouli, Cedarwood, Vanilla, Benzoin, Ambergris, Musk, Sandalwood', '888.00', '0.00', NULL, NULL, 'no', 'no', 'no', NULL, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '6', NULL, 'Simple', NULL, NULL, NULL, NULL, 'Catalog', 90, 'active', 'alwaysInStock', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2022-07-04 16:58:01', NULL, '2022-07-26 18:30:55'),
(1209, 30, 'EXT0025', 'ANI EDP 100 ML', 'ani-edp-100-ml-15', NULL, 'A romantic and calm perfume created under the inspiration of a famous Anatolian folk song called “Sarı Gelin” (in Turkish) or “Sari Gyalin” in Armenian.\r\n', '\"Having been shown by perfume lovers as the best vanilla scent and becoming an iconic scent, highly celebrated ANI is a romantic and calm perfume created under the inspiration of a famous Anatolian folk song called “Sarı Gelin” (in Turkish) or “Sari Gyalin” in Armenian. The similarity of the name of the song in both languages suggests that both nations share a very similar culture as far as art, food or other aspects of life are concerned. ANI is the name of an ancient city that is now known as the Ani Ruins, which was included on UNESCO\'s World Heritage List.\r\n\r\nThe only boundary is in the imagination of the people. This perfume is dedicated to ruining any border between people and empowering the wearer to build his/her own empire even in a situation when all he/she is left with is nothing but ruins.\"\r\n', NULL, 'Bergamot, Green Notes, Blue Ginger, Pink Pepper', 'Blackcurrant, Turkish Rose, Cardamom', 'Patchouli, Cedarwood, Vanilla, Benzoin, Ambergris, Musk, Sandalwood', '1318.00', '0.00', NULL, NULL, 'no', 'no', 'no', NULL, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '6', NULL, 'Simple', NULL, NULL, NULL, NULL, 'Catalog', 80, 'active', 'alwaysInStock', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2022-07-04 17:31:39', NULL, '2022-07-26 18:30:38'),
(1210, 30, 'EXT0022', 'B-612 EDP 50 ML', 'b-612-edp-50-ml-16', NULL, 'Nishane\'s B-612 fragrance invites all perfume lovers to regain their instinct to explore remembering their inner child.\r\n', 'The asteroid of the Little Prince approaches the world with its aromas to make the wearer of this perfume imaginative, open-minded, and aware of and sensitive to the mystery and beauty of the world with its alluring structure bringing back the forgotten traits from childhood. Enlightenment through exploration. NISHANE invites all perfume lovers to regain their instinct to explore remembering their inner child.\r\n', NULL, 'Lavender, Cypress, Geranium', 'Cashmeran, Sandalwood, Patchouli', 'Musk, Oakmoss, Tonka Bean', '888.00', '0.00', NULL, NULL, 'no', 'no', 'no', NULL, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '6', NULL, 'Simple', NULL, NULL, NULL, NULL, 'Catalog', 210, 'active', 'alwaysInStock', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2022-07-04 17:34:29', NULL, '2022-07-26 18:25:50'),
(1211, 30, 'EXC0001', 'COLOGNISE EDP 100 ML', 'colognise-edp-100-ml-21', NULL, 'COLOGNISÉ is a tribute to the Turkish tradition of offering lemon cologne in splash bottles to the guests.', '\"COLOGNISÉ is a tribute to the Turkish tradition of offering lemon cologne in splash bottles to the guests as an inherent way of showing hospitality. NISHANE, as a perfume house famous for its extraits, dreamt of modernizing this tradition with a new concept called “Extrait de Cologne” that has an essence concentration of 18 %.\r\n\r\nThe main challenge was to create a distinguished and long-lasting lemon-based fragrance to honor the traditional lemon cologne. To boost the allurement and the refreshing power of the perfume, the citrus notes were backed by strong musk and flowers. \"\r\n', NULL, 'Bergamot, Lemon, Greentea, Jasmine', 'Grapefruit, Lily of the Valley', 'Vetiver, Neroli, Musk', '615.00', '0.00', NULL, NULL, 'no', 'no', 'no', NULL, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '6', NULL, 'Simple', NULL, NULL, NULL, NULL, 'Catalog', 200, 'active', 'alwaysInStock', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2022-07-04 17:36:52', NULL, '2022-07-26 18:12:58'),
(1212, 30, 'EXT0041', 'EGE EDP 50 ML', 'ege-edp-50-ml-14', NULL, 'EGE / ΑΙΓΑΙΟ is a tribute to the Aegean Sea – an elongated embayment of the Mediterranean Sea. ', 'EGE / ΑΙΓΑΙΟ is a tribute to the Aegean Sea – an elongated embayment of the Mediterranean Sea located between the Greek and Anatolian peninsulas – that has been historically important, especially in regard to the civilization of Ancient Greece, who inhabited the area around the coast of the Aegean and the Aegean islands. The Aegean islands facilitated contact between the people of the area and between Europe and Asia.\r\n', NULL, 'Yuzu, violet leaves, anise', 'Basil, green cardamom, mint ', 'Olibanum, licorice', '888.00', '0.00', NULL, NULL, 'no', 'no', 'no', NULL, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '6', NULL, 'Simple', NULL, NULL, NULL, NULL, 'Catalog', 185, 'active', 'alwaysInStock', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2022-07-04 17:39:56', NULL, '2022-07-26 17:57:02'),
(1213, 30, 'EXT0040', 'EGE EDP 100 ML', 'ege-edp-100-ml-15', NULL, 'EGE / ΑΙΓΑΙΟ is a tribute to the Aegean Sea – an elongated embayment of the Mediterranean Sea. \r\n', 'EGE / ΑΙΓΑΙΟ is a tribute to the Aegean Sea – an elongated embayment of the Mediterranean Sea located between the Greek and Anatolian peninsulas – that has been historically important, especially in regard to the civilization of Ancient Greece, who inhabited the area around the coast of the Aegean and the Aegean islands. The Aegean islands facilitated contact between the people of the area and between Europe and Asia.\r\n', NULL, 'Yuzu, violet leaves, anise', 'Basil, green cardamom, mint ', 'Olibanum, licorice', '1318.00', '0.00', NULL, NULL, 'no', 'no', 'no', NULL, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '6', NULL, 'Simple', NULL, NULL, NULL, NULL, 'Catalog', 180, 'active', 'alwaysInStock', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2022-07-04 17:42:30', NULL, '2022-07-26 17:56:04'),
(1214, 30, 'EXT0017', 'FAN YOUR FLAMES EDP 50 ML', 'fan-your-flames-edp-50-ml-26', NULL, 'Depicts a lovely night out with the company of loved ones smoking shisha with coconut, enjoying the nice chat, anticipating better days to come! Enjoy the good moods to celebrate life!\r\n', '\"Depicts a lovely night out with the company of loved ones smoking shisha with coconut, enjoying the nice chat, anticipating better days to come! Enjoy the good moods to celebrate life!\r\n\r\n‘Set your life on fire and seek those who fan your flames’  ~Rumi\"\r\n', NULL, 'Coconut, Rum', 'Tobacco, Tonka', 'Oakmoss, Chinese Dedarwood', '861.00', '0.00', NULL, NULL, 'no', 'no', 'no', NULL, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '6', NULL, 'Simple', NULL, NULL, NULL, NULL, 'Catalog', 55, 'active', 'alwaysInStock', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2022-07-04 17:51:51', NULL, '2022-07-26 13:46:02'),
