(1217, 30, 'EXT0019', 'Hacivat EDP 50 ML', 'hacivat-edp-50-ml-18', NULL, 'Hacivat is a tribute to elegance, kindness, competence, and love of art. Inspired by the traditional shadow play character.\r\n', 'Hacivat is a tribute to elegance, kindness, competence, and love of art. Inspired by the traditional shadow play character, this Eau chypre will help you live in your best dreams through the everlasting sparkles of its joyful structure made of the stimulating notes of pineapple and bergamot backed with genuine woody notes. Enjoy being loved with this blissful scent that has become an iconic scent for many in such a short period of time!\r\n', NULL, 'Bergamot, Pineapple, Grapefruit', 'Jasmine, Patchouli, Cedarwood', 'Clearwood, Oakmoss, Dry Timberwood', '987.00', '0.00', NULL, NULL, 'no', 'no', 'no', NULL, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '6', NULL, 'Simple', NULL, NULL, NULL, NULL, 'Catalog', 15, 'active', 'alwaysInStock', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2022-07-04 18:00:01', NULL, '2022-07-28 11:55:35'),
(1218, 30, 'EXT0029', 'Hacivat EDP 100 ML', 'hacivat-edp-100-ml-19', NULL, 'Hacivat is a tribute to elegance, kindness, competence, and love of art. Inspired by the traditional shadow play character.\r\n', 'Hacivat is a tribute to elegance, kindness, competence, and love of art. Inspired by the traditional shadow play character, this Eau chypre will help you live in your best dreams through the everlasting sparkles of its joyful structure made of the stimulating notes of pineapple and bergamot backed with genuine woody notes. Enjoy being loved with this blissful scent that has become an iconic scent for many in such a short period of time!\r\n', NULL, 'Bergamot, Pineapple, Grapefruit', 'Jasmine, Patchouli, Cedarwood', 'Clearwood, Oakmoss, Dry Timberwood', '1375.00', '0.00', NULL, NULL, 'yes', 'yes', 'no', NULL, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '6', NULL, 'Simple', NULL, NULL, NULL, NULL, 'Catalog', 10, 'active', 'alwaysInStock', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2022-07-04 18:01:37', NULL, '2022-07-28 11:55:55'),
(1219, 30, 'EXT0018', 'Hundred Silent Ways EDP 50 ML', 'hundred-silent-ways-edp-50-ml-30', NULL, 'Hundred Silent Ways is a tribute to the most-liked perfumes in the history of perfumery with a modern interpretation and blend of pleasant notes.', '\"Hundred Silent Ways Was created as a tribute to the most-liked perfumes in the history of perfumery with a modern interpretation and blend of pleasant notes. With a drop, one would feel wearing the attractiveness of all beautiful souls ever lived on earth and silently share this with everyone he/she encounters. Get ready for the compliments.\r\n\r\n\'I closed my mouth and spoke to you in a hundred silent ways\' ~Rumi \"\r\n', NULL, 'Tuberose, Mandarin, Peach', 'White Jasmin, Gardenia, Orris', 'Vanilla, Sandalwood, Vetiver', '861.00', '0.00', NULL, NULL, 'yes', 'no', 'no', NULL, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '6', NULL, 'Simple', NULL, NULL, NULL, NULL, 'Catalog', 22, 'active', 'alwaysInStock', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2022-07-04 18:04:32', NULL, '2022-07-26 13:44:05'),
(1220, 30, 'EXT0021', 'Karagoz EDP 50 ML', 'karagoz-edp-50-ml-18', NULL, 'KARAGOZ is a tribute to playful treats of life, wittiness, straightforwardness, and sincerity.', 'KARAGOZ is a tribute to playful treats of life, wittiness, straightforwardness, and sincerity. Enjoy being noticed just like the famous shadow puppetry character “Karagöz”. The cheerful opening with the pineapple and the herbs is followed by the strong personality coming from the rich heart made of neroli, jasmine, and patchouli. Vetiver, agarwood, and amber were meant to be the final strokes of the brush to depict this playful character.\r\n', NULL, 'Pineapple, Black Grape, Bouquet Garni', 'Neroli, Jasmine, Patchouli', 'Base Vetiver, Agarwood, Amber', '987.00', '0.00', NULL, NULL, 'no', 'no', 'no', NULL, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '6', NULL, 'Simple', NULL, NULL, NULL, NULL, 'Catalog', 170, 'active', 'alwaysInStock', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2022-07-04 18:08:49', NULL, '2022-07-22 11:17:18'),
(1221, 30, 'EXT0043', 'Nanshe EDP 50 ML', 'nanshe-edp-50-ml-17', NULL, 'Nanshe is suggesting poetic emotions with earthy aromas that will mystically conceive the positiveness even in the darkest times.', '\"Nanshe is the name of a Sumerian goddess of fertility, water, and social justice, which was believed to be the patron of dreams and prophecy. She watched over orphans and widows, oversaw fairness, freshwater, birds and fish, fertility, and favored prophets, giving them the ability to interpret dreams accurately.\r\n\r\n​The main challenge was to create a scent that reflects the kind, compassionate, welcoming, and wise attributes of this divine figure. With Nanshe, NISHANE wishes for a world where the forgotten, the poor, the lonely, and the disenfranchised are looked after.\r\n\r\nSurrounded by a sublime accord of rose which had been widely reported to help fertility by many civilizations, Nanshe is suggesting poetic emotions with earthy aromas that will mystically conceive the positiveness even in the darkest times.\"\r\n', NULL, 'Bergamot, carrot seeds, cardamom, yuzu', 'Water fruits & flowers, rose absolute, jasmine sambac absolute, ylang-ylang', 'Orris, powdery notes, musk, patchouli, sandalwood', '888.00', '0.00', NULL, NULL, 'no', 'no', 'no', NULL, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '6', NULL, 'Simple', NULL, NULL, NULL, NULL, 'Catalog', 165, 'active', 'alwaysInStock', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2022-07-04 18:11:07', NULL, '2022-07-26 17:28:00'),
(1222, 30, 'EXT0042', 'Nanshe EDP 100 ML', 'nanshe-edp-100-ml-18', NULL, 'Nanshe is suggesting poetic emotions with earthy aromas that will mystically conceive the positiveness even in the darkest times.\r\n', '\"Nanshe is the name of a Sumerian goddess of fertility, water, and social justice, which was believed to be the patron of dreams and prophecy. She watched over orphans and widows, oversaw fairness, freshwater, birds and fish, fertility, and favored prophets, giving them the ability to interpret dreams accurately.\r\n\r\n​The main challenge was to create a scent that reflects the kind, compassionate, welcoming, and wise attributes of this divine figure. With Nanshe, NISHANE wishes for a world where the forgotten, the poor, the lonely, and the disenfranchised are looked after.\r\n\r\nSurrounded by a sublime accord of rose which had been widely reported to help fertility by many civilizations, Nanshe is suggesting poetic emotions with earthy aromas that will mystically conceive the positiveness even in the darkest times.\"\r\n', NULL, 'Bergamot, carrot seeds, cardamom, yuzu', 'Water fruits & flowers, rose absolute, jasmine sambac absolute, ylang-ylang', 'Orris, powdery notes, musk, patchouli, sandalwood', '1318.00', '0.00', NULL, NULL, 'no', 'no', 'no', NULL, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '6', NULL, 'Simple', NULL, NULL, NULL, NULL, 'Catalog', 160, 'active', 'alwaysInStock', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2022-07-04 18:13:18', NULL, '2022-07-26 17:25:14'),
(1223, 30, 'EXT0099', 'MANA EDP 50 ML', 'mana-edp-50-ml-15', NULL, 'With MANA, NISHANE is inviting everyone to find the meaning in life and the inner force that will help them create the life they choose, leave their own mark and unfold their own myth.\r\n', '\"With MANA, NISHANE is inviting everyone to find the meaning in life and the inner force that will help them create the life they choose, leave their own mark and unfold their own myth. MANA means meaning. Throughout modern history, one of the questions that humans have asked the most is “What is the meaning of life?\"\r\nWe are all hungry for meaning, for purpose, for the feeling that our life is worth more than the sum of its parts. Luckily, humans are resourceful – we have infinite ways of finding meaning, and infinite potential sources of meaning. We can find meaning in every scenario, every event, every occurrence, every context. We can find meaning in the sublime, in the absurd, in the dull and dreary, and in the perfectly wretched in life.\r\nWe intuitively know that we want meaning in our lives and that meaning helps us thrive.\"\r\n', NULL, 'saffron, ginger, black pepper, cardamom', 'oud, Turkish rose, castoreum, suede', 'cistus labdanum, patchouli, sandalwood, guaiac wood, moss, benzoin, olibanum, musk', '2205.00', '0.00', NULL, NULL, 'no', 'no', 'no', NULL, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '6', NULL, 'Simple', NULL, NULL, NULL, NULL, 'Catalog', 30, 'active', 'alwaysInStock', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2022-07-04 18:16:33', NULL, '2022-07-26 12:56:56'),
(1224, 30, 'EXT0026', 'NEFS EDP 50 ML', 'nefs-edp-50-ml-15', NULL, 'NEFS is a luxurious interpretation of oriental notes. A scent to revive the fantasies told by the stories of One Thousand and One Nights of the Orient.', 'NEFS is a luxurious interpretation of oriental notes. Like Istanbul itself, the masterful creations of Nishane straddle the line between Europe and Asia, synthesizing the palettes and traditions of both in the service of dynamic, modern perfumery. And so it\'s unsurprising that Nefs, conceptualized as the line\'s flagship oriental scent, strives for a new, modern oriental- an East-meets-West portrait of refined luxury to sway even those who dislike oriental fragrances. Like a breeze blowing from the east across the Bosphorus, Nefs is an exquisite oriental that bridges the gap between civilizations. A scent to revive the fantasies told by the stories of One Thousand and One Nights of the Orient.\r\n', NULL, 'Honey, Violet, Sage, Saffron, Fig', 'Rose, Osmanthus, Geranium, jasmine, nutmeg', 'Amber, Whiskey, Oud, Cinnamon, Cedarwood, Gurjum, Leather, Vanilla', '2205.00', '0.00', NULL, NULL, 'no', 'no', 'no', NULL, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '6', NULL, 'Simple', NULL, NULL, NULL, NULL, 'Catalog', 40, 'active', 'alwaysInStock', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2022-07-04 18:24:34', NULL, '2022-07-22 11:21:30'),
(1225, 30, 'EXC0002', 'Safran Colognise EDP 100 ML', 'safran-colognise-edp-100-ml-28', NULL, 'In 2018, NISHANE had launched COLOGNISÉ which is a tribute to the Turkish tradition of offering lemon cologne in splash bottles to the guests as an inherent way of showing hospitality.\r\n', 'After the global success of Colognisé, NISHANE has decided to extend the “Extrait de Cologne Collection” with new offerings that will still remind the original Colognisé but will have a different take on some accords for different tastes. The main note of saffron helps to add a mysterious and rich allure to the scent.\r\n', NULL, 'Cedrat, Passion Fruit, Pink Grapefruit', 'Saffron, Magnolia, Pink Pepper', 'Musk, Ambergris, Leather', '615.00', '0.00', NULL, NULL, 'no', 'no', 'no', NULL, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '6', NULL, 'Simple', NULL, NULL, NULL, NULL, 'Catalog', 150, 'active', 'alwaysInStock', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2022-07-04 18:27:46', NULL, '2022-07-26 17:11:42'),
(1226, 30, 'EXT0045', 'SHEM EDP 50ML', 'shem-edp-50ml-14', NULL, 'Shem means Candle. NISHANE is inviting everyone to enjoy shining his/her own light that will help them follow their own path with the enlightening scent of Shem.\r\n', '\"NISHANE is proud to launch the second reference of our “Prestige Collection” that started with NEFS in the year 2019. With the enlightening scent of Shem, NISHANE is inviting everyone to enjoy shining his/her own light that will help them follow their own path.\r\n\r\nShem means candle. A candle loses nothing by lighting another candle. Thousands of candles can be lighted from a single candle and the life of the candle will not be shortened. Happiness never decreases by being shared.\r\n\r\nAs we let our light shine, we unconsciously give other people permission to do the same. As we are liberated from our own fear, our presence actually liberates others.\r\n\r\n“Let light shine out of the darkness.”', NULL, 'Cardamom – Turkish Rose – Geranium', 'Osmanthus – Amber – Cypriol', 'Elemi – Vetiver – Leather', '2205.00', '0.00', NULL, NULL, 'no', 'no', 'no', NULL, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '6', NULL, 'Simple', NULL, NULL, NULL, NULL, 'Catalog', 33, 'active', 'alwaysInStock', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2022-07-04 18:29:53', NULL, '2022-07-26 13:09:15'),
(1227, 30, 'EXT0013', 'SUEDE ET SAFRAN EDP 50 ML', 'suede-et-safran-edp-50-ml-26', NULL, 'Gives the feeling of a tailored leather jacket spiced with saffron from Iran and ambrette seed from India. A chic and fascinating signature suite.', 'Gives the feeling of a tailored leather jacket spiced with saffron from Iran and ambrette seed from India. A chic and fascinating signature suite.\r\n', NULL, 'Ambrette Seed, Saffron', 'Suede, Ginger', 'Musk, Leather', '930.00', '0.00', NULL, NULL, 'no', 'no', 'no', NULL, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '6', NULL, 'Simple', NULL, NULL, NULL, NULL, 'Catalog', 70, 'active', 'alwaysInStock', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2022-07-04 18:32:18', NULL, '2022-07-26 18:30:06'),
(1228, 30, 'EXT0008', 'Sultan Vetiver EDP 50 ML', 'sultan-vetiver-edp-50-ml-25', NULL, 'Sultan Vetiver is the new rule-breaker in its genre. This is a heavenly perfume for vetiver lovers.', 'Opens on a neroli note intensified by Javanese, Haitian, and Bourbon vetiver at the same pot! As the sultans and the kings were the actual conquerors for ages, Sultan Vetiver is the new rule-breaker in its genre. This is a heavenly perfume for vetiver lovers.', NULL, 'Vetiver Java, Absinthe, Schinus Molle, Bergamot', 'Vetiver Bourbon, Vetiver Haiti, Neroli, Tonka', 'Amberwood, Leather, Vetiver Brazil', '756.00', '0.00', NULL, NULL, 'no', 'no', 'no', NULL, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '6', NULL, 'Simple', NULL, NULL, NULL, NULL, 'Catalog', 140, 'active', 'alwaysInStock', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2022-07-04 18:34:09', NULL, '2022-07-22 11:12:43'),
