(1230, 30, 'EXT0023', 'Vain & Naïve EDP 50 ML', 'vain-&-naïve-edp-50-ml-23', NULL, 'Discover the enchanting smell of the flower that Little Prince is in love with, which is simultaneously vain and naïve.\r\n', 'Vain and Naive is a tribute to each “unique love” ever experienced on earth. It is the time you have wasted for your rose that makes your rose so important. Discover the enchanting smell of the flower that Little Prince is in love with, which is simultaneously vain and naïve. \"There might be millions of roses in the whole world, but you are my only one, unique rose.\"\r\n', NULL, 'Bergamot, Orange', 'Rose, Jasmin, Cedar, Plum, Raspberry', 'Sandalwood, Amber, Patchouli, Tonka Bean, Musk', '888.00', '0.00', NULL, NULL, 'no', 'no', 'no', NULL, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '6', NULL, 'Simple', NULL, NULL, NULL, NULL, 'Catalog', 120, 'active', 'alwaysInStock', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2022-07-04 18:38:40', NULL, '2022-07-26 16:35:13'),
(1231, 30, 'EXT0001', 'Wulong Cha EDP 50 ML', 'wulong-cha-edp-50-ml-21', NULL, 'WŪLÓNG CHÁ opens on citrus notes of bergamot, orange, and mandarin. While Mediterranean fig and musk provide a base for the fragrance, Chinese oolong tea mesmerizes in an evasive way.\r\n', 'WŪLÓNG CHÁ has one of the strongest fresh scents in the market, it opens on citrus notes of bergamot, orange, and mandarin that provide sparkling freshness. While Mediterranean fig and musk provide a base for the fragrance, oolong tea mesmerizes in an evasive way.\r\n', NULL, 'Bergamot, Orange, Litsea, Mandarin', 'Oolong Tea, Nutmeg', 'Musk, Fig', '756.00', '0.00', NULL, NULL, 'no', 'no', 'no', NULL, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '6', NULL, 'Simple', NULL, NULL, NULL, NULL, 'Catalog', 115, 'active', 'alwaysInStock', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2022-07-04 18:41:27', NULL, '2022-07-22 11:01:41'),
