(1233, 30, 'EXT0020', 'Zenne EDP 50 ML', 'zenne-edp-50-ml-16', NULL, 'Inspired by the female character in traditional shadow puppetry, ZENNE is a tribute to beauty, energy, self-confidence, and flirtation.', 'ZENNE is a tribute to beauty, energy, self-confidence, and flirtation. Inspired by the female character in the traditional shadow puppetry, Zenne will teleport you to the enigmas of the paradise gardens full of joy and romance with a deliberate mix of fruity and floral accords along with vanilla, ambergris, and musk at the base.\r\n', NULL, 'Grapefruit, Blackcurrant, Rhubarb', 'Turkish rose, Gardenia, Sandalwood', 'Vanilla, Ambergris, Musk', '987.00', '0.00', NULL, NULL, 'no', 'no', 'no', NULL, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '6', NULL, 'Simple', NULL, NULL, NULL, NULL, 'Catalog', 100, 'active', 'alwaysInStock', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2022-07-04 18:46:24', NULL, '2022-07-26 16:04:50'),
(1234, 30, 'HP004', 'ANI Hair Perfume 50 ML', 'ani-hair-perfume-50-ml-23', NULL, 'NISHANE Hair Perfumes give your hair an unprecedented scent together with unprecedented care.\r\n', 'With NISHANE Hair Perfumes, your hair will have an unprecedented scent together with unprecedented care. With their unique formula that combines panthenol and silk extract, NISHANE Hair Perfumes will moisturize your hair while adding shine and softness to it. They will also help condition your hair, giving it supremely healthy and voluminous locks.\r\n', NULL, '', '', '', '325.00', '0.00', NULL, NULL, 'no', 'no', 'no', NULL, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '6', NULL, 'Simple', NULL, NULL, NULL, NULL, 'Catalog', 240, 'active', 'alwaysInStock', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2022-07-04 18:54:11', NULL, '2022-07-22 16:06:22'),
