(1238, 30, 'COLADM100', 'ADMIRABILIS EDP 100 ML', 'admirabilis-edp-100-ml-23', NULL, 'Admirabilis, a mysterious and addictive breath.', '\"An emotion of serenity and beauty emerges from the Abbey of Fontfroide\'s outstanding place, both amazing and mysterious. This Cistercian abbey invites us on a journey back in time, along its walls and stone vaults In this place full of character resonates this sacred perfume composed of balms and hot resins.\r\n\r\nAdmirabilis, a mysterious and addictive breath.\"', NULL, 'Mandarin Orange, Bergamot, Elemi, Violet Leaf and Lemon', 'Cedar, Cloves and Cypriol Oil ', 'Musk, Patchouli, Amber, Incense, Myrrh, Labdanum', '657.00', '0.00', NULL, NULL, 'no', 'no', 'no', NULL, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '7', NULL, 'Simple', NULL, NULL, NULL, NULL, 'Catalog', 40, 'active', 'alwaysInStock', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2022-07-04 19:23:05', NULL, '2022-07-27 10:53:19'),
(1239, 30, 'BOH100', 'BÔHARAS EDP 100 ML', 'bôharas-edp-100-ml-19', NULL, 'BôHaras, a duel of character between man and animal.\r\n', '\"The wind of sand comes knocking on the wooden door of the Selman stud farm. The singular and majestic body of the Arabian Thoroughbreds responds to a fragrance of character with the burning scent of leather, wood, and amber. Nestled in the heart of the most beautiful stable of the Kingdom of Morocco, BôHaras is inspired by this majestic place full of elegance. \r\n\r\nBôHaras, a duel of character between man and animal.\"\r\n', NULL, 'Cardamom', 'Leather', 'Amber', '657.00', '0.00', NULL, NULL, 'yes', 'no', 'no', NULL, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '7', NULL, 'Simple', NULL, NULL, NULL, NULL, 'Catalog', 10, 'active', 'alwaysInStock', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2022-07-04 19:35:22', NULL, '2022-07-27 11:56:35'),
(1240, 30, 'LM14', 'BOIS DE FEU EDP 100 ML', 'bois-de-feu-edp-100-ml-23', NULL, 'Lying by the fireside, at the pace of the wood cracklings.\r\n', '\"At the end of a dark passage, a hotel is made from bricks with some walls painted in black. Behind the door, the atmosphere seems mysterious. The room is lit up by a crackling open fire spreading a sweet smell of wood. The antique furniture’s shadows are dancing on the walls. Bois de Feu is a fragrance that gives the wood a majestic and comforting aroma.\r\n\r\nLying by the fireside, at the pace of the wood cracklings.\"\r\n', NULL, 'Olibanum', 'Ginger', 'Papyrus', '657.00', '0.00', NULL, NULL, 'no', 'no', 'no', NULL, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '7', NULL, 'Simple', NULL, NULL, NULL, NULL, 'Catalog', 60, 'active', 'alwaysInStock', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2022-07-04 19:37:11', NULL, '2022-07-27 11:57:43'),
(1241, 30, 'COLCASH100', 'CASHMERE EDP 100 ML', 'cashmere-edp-100-ml-20', NULL, 'Cashmere, the soul of a place between leather and velvet.\r\n', '\"When world-renowned interior designer Jacques Garcia renovated the Champ de Bataille castle, the result was dazzling. The property came back to life with an atmosphere, a decor sticking to its values. So, on a cold winter day, near a stone fireplace, a sweat treat spontaneously took place in the former stables. Wrapped in a pashmina, between leather and corduroy, Cashmere was born.\r\n\r\nCashmere, the soul of a place between leather and velvet.\"\r\n', NULL, 'Bergamot', 'Amber', 'Guaiac wood', '657.00', '0.00', NULL, NULL, 'no', 'no', 'no', NULL, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '7', NULL, 'Simple', NULL, NULL, NULL, NULL, 'Catalog', 50, 'active', 'alwaysInStock', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2022-07-04 19:40:04', NULL, '2022-07-27 11:58:51'),
(1242, 30, 'LM11', 'CUIR ETERNEL EDP 100 ML', 'cuir-eternel-edp-100-ml-24', NULL, 'Cuir Éternel, an escape at the heart of an ancient market, full of spicy scents.\r\n', '\"Walk around the most ancient souk in Cairo, La Victorieuse. Under the vaulted arcades, traders and curious people hurry up to find Oriental treasures, marveled by these endless arrows. Inspired by the frenzy of the place, Cuir Éternel invites to an olfactory travel full of colors.\r\n\r\n Cuir Éternel, an escape at the heart of an ancient market, full of spicy scents.\"\r\n', NULL, 'Violet Leaves', 'Leather', 'Cedar', '657.00', '0.00', NULL, NULL, 'no', 'no', 'no', NULL, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '7', NULL, 'Simple', NULL, NULL, NULL, NULL, 'Catalog', 90, 'active', 'alwaysInStock', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2022-07-04 19:42:28', NULL, '2022-07-27 12:01:18'),
(1243, 30, 'COLNOB100', 'NOBLE EDP 100 ML', 'noble-edp-100-ml-17', NULL, 'Noble, the spirit of a place where everything is refined.', '\"Strolling throughout the private apartments and reception halls of this Aix en Provence private mansion leads to finding the aristocratic spirit of the XVIIth century. Noble pays a tribute to this place’s nobility with a fresh and sober fragrance.\r\n\r\nNoble, the spirit of a place where everything is refined.\"\r\n', NULL, 'Mandarin', 'Cardamom', 'Musk', '472.00', '0.00', NULL, NULL, 'no', 'no', 'no', NULL, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '7', NULL, 'Simple', NULL, NULL, NULL, NULL, 'Catalog', 80, 'active', 'alwaysInStock', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2022-07-04 19:44:20', NULL, '2022-07-27 12:02:08'),
(1244, 30, 'REV100', 'RÊVE OTTOMAN EDP 100 ML', 'rêve-ottoman-edp-100-ml-24', NULL, '\"Rêve Ottoman is sensual and addictive, exhaling its sovereign aroma of Amber, Arabian Rose, and Saffron.\r\n\r\nRêve Ottoman, unexpected meeting with the mystery of the East.\"', '\"We begin to imagine Sultan Abdulmecid wandering in his Dolmabahçe Palace on the banks of the Bosphorus. A palace with a thousand treasures where hidden corridors, stolen stairs, and secret fountains are the witnesses of the Orient’s intrigues. From this dream comes the spellbinding note of the Orient. Rêve Ottoman is sensual and addictive, exhaling its sovereign aroma of Amber, Arabian Rose, and Saffron.\r\n\r\nRêve Ottoman, unexpected meeting with the mystery of the East.\"\r\n', NULL, 'Saffron', 'Rose ', 'Sandalwood', '657.00', '0.00', NULL, NULL, 'no', 'no', 'no', NULL, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '7', NULL, 'Simple', NULL, NULL, NULL, NULL, 'Catalog', 70, 'active', 'alwaysInStock', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2022-07-04 19:51:17', NULL, '2022-07-27 12:03:08'),
(1245, 30, 'LM13', 'SUEDE ELIXIR EDP 100 ML', 'suede-elixir-edp-100-ml-24', NULL, 'Contemplation of this spiritual place marbled with gold reflecting the glow and warmth of the sun.', '\"Build within a spiritual site stands the most majestic temple: The Golden Temple. Surrounded by a sacred lake, a magnificent marble bridge is a unique access to the shrine, like an enchanted passage filled with leathery aroma. The contemplation of this edifice covered with fine gold reflects the warmness of the sun and the sparkle of the shining temple. Suède Elixir is an ode to a warm memory within its walls, brushing the delicate water around.\r\n\r\nContemplation of this spiritual place marbled with gold reflecting the glow and warmth of the sun.\"\r\n', NULL, 'Cinnamon bark', 'Ciste', 'Leather', '657.00', '0.00', NULL, NULL, 'yes', 'no', 'no', NULL, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '7', NULL, 'Simple', NULL, NULL, NULL, NULL, 'Catalog', 20, 'active', 'alwaysInStock', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2022-07-04 19:54:56', NULL, '2022-07-27 12:04:02'),
(1246, 30, 'LM12', 'SYMPHONIE EDP 100 ML', 'symphonie-edp-100-ml-21', NULL, 'Symphonie, immersion in the intimate atmosphere of the Royal Opera House where singers and dancers become one.', '\"The lights turned off, the curtain goes up and the first notes are ringing out. To the architectural majesty of the Muscat opera respond the orchestra melody and its tenors’ lyricism. From this harmony arises Symphonie, a sensual and intense fragrance. With its woody notes and incense, the audience escapes from time.\r\nSymphonie, immersion in the intimate atmosphere of the Royal Opera House where singers and dancers become one.\"\r\n', NULL, 'Incense', 'Cardamom', 'White Amber', '657.00', '0.00', NULL, NULL, 'no', 'no', 'no', NULL, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '7', NULL, 'Simple', NULL, NULL, NULL, NULL, 'Catalog', 30, 'active', 'alwaysInStock', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2022-07-04 19:56:43', NULL, '2022-07-27 12:05:20'),
(1247, 30, 'MIEDP75BA', 'BARREL EDP 75 ML', 'barrel-edp-75-ml-17', NULL, '\"Barrel Extrait de Parfum honors the vessel that infuses the exquisite aroma through its nurturing embrace.\r\n\r\nA slight floral opening gives way to bold & beautiful notes. Peaty, smoky, smooth & earthy, the scent of the selfless vessel, incubating the finest spirits throughout the years.\"\r\n', '\"A slight floral opening gives way to bold & beautiful notes. \r\n\r\nPeaty, smoky, smooth & earthy, the scent of the selfless vessel, incubating the finest spirits throughout the years.\r\n\r\nWithout a properly cured, aged barrel there would be no rare whiskey, impressive bourbon, or outstanding cognac. Here, we have honored the vessel that infuses the exquisite aroma through its nurturing embrace. The infusion of this tangible object to the spirit of a perfume culminates in both surrender and seduction.\"\r\n', NULL, 'Absinthe, Coriander & Pink Peppercorn', 'Rum, Myrrh & Orange Blossom', 'Oak Barrel, Leather, Vanilla, Patchouli & Vetyver', '1199.00', '0.00', NULL, NULL, 'no', 'no', 'no', NULL, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '8', NULL, 'Simple', NULL, NULL, NULL, NULL, 'Catalog', 90, 'active', 'alwaysInStock', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2022-07-04 20:30:07', NULL, '2022-08-22 12:06:31');
