(1248, 30, 'MIEDP75CO', 'CODA EDP 75 ML', 'coda-edp-75-ml-15', NULL, 'A luminous aldehydic opening contrasts a sensual & smoldering heart. Luscious plums, flowers & woods meet sumptuous leather & musk. CODA leaves you satisfied with a sense of balance. Rock star chic.', '\"A luminous aldehydic opening contrasts a sensual & smoldering heart. Luscious plums, flowers & woods meet sumptuous leather & musk. CODA leaves you satisfied with a sense of balance. Rock star chic.\r\n\r\nRegardless of the tune of your personal chemistry, this scent is a true soundtrack of attraction. Cooling and warming the wearer’s skin at the same time, Coda is rock star chic, provocative and refined with a bit of edge.\"', NULL, 'Cypress, Eucalyptus & Mint', 'Ceylon, Cinnamon Bar Oil, Nutmeg & Cedarwood', 'Amberwood, Ciste Absolute & Patchouli', '1199.00', '0.00', NULL, NULL, 'yes', 'no', 'no', NULL, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '8', NULL, 'Simple', NULL, NULL, NULL, NULL, 'Catalog', 20, 'active', 'alwaysInStock', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2022-07-04 20:35:37', NULL, '2022-08-22 12:05:54'),
(1249, 30, 'MIEDP75DA', 'DAHAB EDP 75 ML', 'dahab-edp-75-ml-16', NULL, '\"DAHAB means “time goes”, it’s where the desert meets the sea & stars. Oud burns in the distance mingle with the warm spicy air.\"', '\"DAHAB means \"\"time goes\"\", it\'s where the desert meets the sea & Stars.\r\n\r\nOud burns in the distance, mingling with the warm spicy air.\r\n\r\nFounder Chad Murawczyk developed this scent as an homage to his time spent in Dahab, the demilitarized zone between Egypt and Israel, on the coast of the Red Sea. Little known to most, it is a scuba destination in its own desert oasis. While Chad is an avid diver as well, inspiration for the scent was nearly all drawn from the Night; sleeping on rooftops nearby. It was designed by the warm, fragrant desert breeze, carried from the sea and down the ancient Silk Road.\"\r\n', NULL, 'Galbanum, Cinnamon, Saffron, Lime & Nutmeg', 'Frankincense, Benzoin, Cypress & Geranium', 'Cedarwood, Musk, Amber & Oud (Agarwood)', '1199.00', '0.00', NULL, NULL, 'no', 'no', 'no', NULL, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '8', NULL, 'Simple', NULL, NULL, NULL, NULL, 'Catalog', 80, 'active', 'alwaysInStock', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2022-07-04 20:38:11', NULL, '2022-08-22 12:05:16'),
(1250, 30, 'MIEDP75MD', 'MOON DUST EDP 75 ML', 'moon-dust-edp-75-ml-20', NULL, '\"It is said that the moon smells of gunpowder after a desert rain.\r\n\r\nMysterious. Futuristic. Poetic.\"\r\n', '\"It is said that the moon smells of gunpowder after a desert rain.\r\n\r\nMysterious. Futuristic. Poetic.\r\n\r\nIn the archives of NASA, a beautiful description of the moon by an astronaut stands out among the rest. Omnipresent dust, burnt gunpowder, rain—all were used to create the otherworldly scent brief of the final chapter of volume 1. An instant global bestseller, it is a scent that both culminates and epitomizes the wanderlust and fearlessness of the human spirit.\"\r\n', NULL, 'Coriander, Mineral Accord & Carrot Seed', 'Flint, Ozone & Tobacco ', 'Benzoin, Earth & Black Musk', '1199.00', '0.00', NULL, NULL, 'no', 'no', 'no', NULL, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '8', NULL, 'Simple', NULL, NULL, NULL, NULL, 'Catalog', 70, 'active', 'alwaysInStock', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2022-07-04 20:40:00', NULL, '2022-08-22 12:04:27'),
(1251, 30, 'MIEDP75OSB', 'OLD SCHOOL BENCH EDP 75 ML', 'old-school-bench-edp-75-ml-27', NULL, 'A noir memory of the classroom back in the day. This scent is an ode to days of relentless creation and total devotion, pencil sharpenings, and charcoal.\r\n', '\"A noir memory of the classroom back in the day.\r\n\r\nPencil Shavings, charcoal on paper, blackboards and vintage desks.\r\n\r\nThis scent is an ode to days of relentless creation and total devotion, pencil sharpenings, and charcoal. The pursuit to communicate what is held deep within each gifted artist breaks through on the canvas and journeys into scent.\"', NULL, 'Lemon, Bergamot & Angelica Root', 'Geranium, Rum, Cocoa & Wood Wax', 'Cedarwood, Vanilla, Patchouli & Vetyver', '1199.00', '0.00', NULL, NULL, 'no', 'no', 'no', NULL, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '8', NULL, 'Simple', NULL, NULL, NULL, NULL, 'Catalog', 60, 'inactive', 'alwaysInStock', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2022-07-04 20:41:42', NULL, '2022-08-09 13:31:16'),
(1252, 30, 'MIEDP75PL', 'PLUSH EDP 75 ML', 'plush-edp-75-ml-16', NULL, 'Plush is a quality we appreciate in all things we like to touch- and especially true when thinking of cashmere, velvet, and silk. Vanilla, jasmine & orange blossom are carefully blended into a bouquet of luxurious musks & finished with a dose of ambergris.', '\"Vanilla, jasmine & orange blossom are carefully blended into a bouquet of luxurious musks & finished with a dose of ambergris.\r\n\r\nMetallic facets of galbanum magnify this dynamic & textured perfume.\r\n\r\nPlush is a quality we appreciate in all things we like to touch- and especially true when thinking of cashmere, velvet, and silk. This fragrance, inspired purely by items pleasurable to the touch, is the only one in the range to contain the certain sweetness found only in almond extract. Addictive, flirtatious beyond imagination and globally acknowledged as seductive beyond belief, Plush has become one of the absolute bestsellers out of all three Volumes.\"\r\n', NULL, 'Almond, Galbanum & Clove Bud', 'Jasmine, Iris & Orange Blossom ', 'Vanilla Bean, Ambergris & Musk', '1199.00', '0.00', NULL, NULL, 'yes', 'no', 'no', NULL, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '8', NULL, 'Simple', NULL, NULL, NULL, NULL, 'Catalog', 10, 'active', 'alwaysInStock', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2022-07-04 20:43:24', NULL, '2022-08-22 12:03:15'),
(1253, 30, 'MIEDP75SH', 'SHAMAN EDP 75 ML', 'shaman-edp-75-ml-17', NULL, 'Transforming a spiritual journey into an olfactive experience resulted in one of the most emblematic scent stories. Dedicated to the Magical, mystical time travelers. Guardians of sacred spirits.', '\"Magical, mystical time travelers.Guardians of sacred spirits.\r\n\r\nOtherworldly, this love potion is sensual & Infinite.\r\n\r\n\r\nProfoundly impressed by the depth of their spirituality which transcends both time and space, founder chad Murawczyk dedicated a fragrance to these rare elusive individuals, for they exist in more than one dimension at the same time. Transforming a spiritual journey into an olfactive experience resulted in one of the most emblematic scent stories within Volume 1.\"\r\n', NULL, 'Violet Leaf, Mandarin & Cardamom', 'Frankincense, Cistus-labdanum, Nutmeg & Rose Absolute', 'Ambergris, Patchouli, Styrax & Honey', '1199.00', '0.00', NULL, NULL, 'no', 'no', 'no', NULL, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '8', NULL, 'Simple', NULL, NULL, NULL, NULL, 'Catalog', 50, 'active', 'alwaysInStock', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2022-07-04 20:45:00', NULL, '2022-08-22 12:02:34'),
(1254, 30, 'MIEDP75SD', 'STARDUST EDP 75 ML', 'stardust-edp-75-ml-19', NULL, '\"Stardust is the tangible representation of both the power and passion possessed in each of us.\r\nThis scent is blended with ingredients to evoke the powerful draw and allure brought about by the materials that create us and to serve as a reminder of the delicate power within ourselves.\"\r\n', '\"Every atom of our being originated from an exploding star.\r\n\r\nAs finite souls in an infinite universe, we are beautifully formed cosmic material shaped by the culmination of our actions.\r\n\r\nStardust is the tangible representation of both the power and passion possessed in each of us.\r\n\r\nNot much is understood about the cosmic realm, yet humans have always been magnetically drawn to it for its vast, infinite, and mysteriously spiritual space. This scent is blended with ingredients to evoke the powerful draw and allure brought about by the materials that create us and to serve as a reminder of the delicate power within ourselves.\"\r\n', NULL, 'Violet, Carnation & Aldehydes', 'Egyptian Jasmine, Turkish Rose & Tunisian Orange Flower', 'Musk, Tonka Bean & Oak Moss', '1199.00', '0.00', NULL, NULL, 'no', 'no', 'no', NULL, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '8', NULL, 'Simple', NULL, NULL, NULL, NULL, 'Catalog', 40, 'active', 'alwaysInStock', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2022-07-04 20:54:42', NULL, '2022-08-22 12:01:55'),
(1255, 30, 'MIEDP75VD', 'VOODOO EDP 75 ML', 'voodoo-edp-75-ml-17', NULL, 'This convergence of body & soul ignites a fire of mysterious & inexplicable attraction. A potent infusion of depth & intensity built around notes traditionally found in Bukhoor (oud, sandalwood, rose, patchouli) catalyzes the unification of energy, spirit & mortality.', '\"There exists a distinct amount of time before moments convert to memories.\r\n\r\nThis convergence of body and soul ignites a fire of mysterious and inexplicable attraction.\r\n\r\nFounder Chad Murawczyk created the scent brief to honor the depth, intensity, and purity of a treasured relationship he shares. Sensuality, magnetic personality, and intensely pure moments are built around notes traditionally found in Bakhoor (oud, sandalwood, rose, patchouli). The burning of Bakhoor is believed to purify energy, strengthen the spirit, and allow for souls to converge and ignite.\"\r\n', NULL, 'Cardamom, Galbanum, Lime, Pink Pepper', 'Geranium, Olibanum, Turkish Rose', 'Patchouli, Leather, Sandalwood, Oud', '1199.00', '0.00', NULL, NULL, 'no', 'no', 'no', NULL, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '8', NULL, 'Simple', NULL, NULL, NULL, NULL, 'Catalog', 30, 'active', 'alwaysInStock', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2022-07-04 20:58:39', NULL, '2022-07-22 16:02:46'),
(1256, 30, 'MICHEVCO ', 'CODA HAIR PERFUME 75 ML', 'coda-hair-perfume-75-ml-24', NULL, '\"DESIGNED TO BE LONG-LASTING AND PROVIDE FULL HAIR COVERAGE WITHOUT DRYING OR DAMAGING HAIR.\r\n\r\nScent your hair with the most indulgent Scent Stories format; spray onto a brush or directly onto hair for full coverage.\r\n\r\nHAIR PERFUME blended with CODA.\"', '\"DESIGNED TO BE LONG-LASTING AND PROVIDE FULL HAIR COVERAGE WITHOUT DRYING OR DAMAGING HAIR.\r\n\r\nScent your hair with the most indulgent Scent Stories format; spray onto a brush or directly onto hair for full coverage.\r\n\r\nHAIR PERFUME blended with CODA.\"\r\n', NULL, '', '', '', '242.00', '0.00', NULL, NULL, 'no', 'no', 'no', NULL, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '8', NULL, 'Simple', NULL, NULL, NULL, NULL, 'Catalog', 130, 'active', 'alwaysInStock', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2022-07-04 21:08:12', NULL, '2022-07-22 16:02:30'),
(1257, 30, 'MICHEVPL ', 'PLUSH HAIR PERFUME 75 ML', 'plush-hair-perfume-75-ml-25', NULL, '\"DESIGNED TO BE LONG-LASTING AND PROVIDE FULL HAIR COVERAGE WITHOUT DRYING OR DAMAGING HAIR.\r\n\r\nScent your hair with the most indulgent Scent Stories format; spray onto a brush or directly onto hair for full coverage.\r\n\r\nHAIR PERFUME blended with PLUSH.\"', '\"DESIGNED TO BE LONG-LASTING AND PROVIDE FULL HAIR COVERAGE WITHOUT DRYING OR DAMAGING HAIR.\r\n\r\nScent your hair with the most indulgent Scent Stories format; spray onto a brush or directly onto hair for full coverage.\r\n\r\nHAIR PERFUME blended with PLUSH.\"', NULL, '', '', '', '242.00', '0.00', NULL, NULL, 'no', 'no', 'no', NULL, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '8', NULL, 'Simple', NULL, NULL, NULL, NULL, 'Catalog', 120, 'active', 'alwaysInStock', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2022-07-04 21:10:00', NULL, '2022-07-22 16:02:16'),
(1258, 30, 'MICHEVSD ', 'STARDUST HAIR PERFUME 75 ML', 'stardust-hair-perfume-75-ml-28', NULL, '\"DESIGNED TO BE LONG-LASTING AND PROVIDE FULL HAIR COVERAGE WITHOUT DRYING OR DAMAGING HAIR.\r\n\r\nScent your hair with the most indulgent Scent Stories format; spray onto a brush or directly onto hair for full coverage.\r\n\r\nHAIR PERFUME blended with STARDUST.\"', '\"DESIGNED TO BE LONG-LASTING AND PROVIDE FULL HAIR COVERAGE WITHOUT DRYING OR DAMAGING HAIR.\r\n\r\nScent your hair with the most indulgent Scent Stories format; spray onto a brush or directly onto hair for full coverage.\r\n\r\nHAIR PERFUME blended with STARDUST.\"\r\n', NULL, '', '', '', '242.00', '0.00', NULL, NULL, 'no', 'no', 'no', NULL, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '8', NULL, 'Simple', NULL, NULL, NULL, NULL, 'Catalog', 140, 'active', 'alwaysInStock', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2022-07-04 21:12:18', NULL, '2022-07-22 16:01:41'),
(1259, 30, 'RM001', 'No.1 EDP 100 ML', 'no.1-edp-100-ml-16', NULL, 'Inspired by the Mediterranean, the freshness of the sea, and the scents of spring, Rosendo Mateu N°1 is an aromatic fragrance with green notes typical of Mediterranean countries\r\n', 'Rosendo Mateu N°1 reminiscent of spring, with a strong presence of Mediterranean freshness; the characteristic scent of the coast of Spain, Italy or Greece. Its unique combination gives this unisex fragrance a distinct fresh and strong presence on the skin that will surprise fans of subtle scents.\r\n', NULL, 'Calabrian bergamot, Lime, Green Mandarin, Sage, Lavender, Rosemary and Thyme', 'Tea Leaf, Bitter Orange Blossom, Neroli, Green Pepper, Jasmine, Lily-of-the-Valley and Cardamom', 'White Musk, iris and Sandalwood', '888.00', '0.00', NULL, NULL, 'no', 'no', 'no', NULL, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '9', NULL, 'Simple', NULL, NULL, NULL, NULL, 'Catalog', 30, 'active', 'alwaysInStock', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2022-07-05 10:46:22', NULL, '2022-07-27 13:49:25'),
(1260, 30, 'RM002', 'No.2 EDP 100 ML', 'no.2-edp-100-ml-16', NULL, 'Rosendo Mateu N° 2 is an elegant, exotic and sensual fragrance. starts with a base of patchouli and sandalwood, later combining them with rose and geranium, finishing up with the floral accord.', '\"Rosendo Mateu N°2 is a high-quality and luxury suede leather, combined with sandalwood and patchouli.\r\n\r\nThe fragrances open with soft and light citric green notes of Calabrian bergamot and lemon. The middle note is a combination of fresh rose, geranium leaves, and floral accord.\r\n\r\nThis combination is fixed on the skin with white musk and vanilla.\"\r\n', NULL, 'Calabrian bergamot and Lemon', 'Flowers, Geranium and Rose', 'Suede, Sandalwood and Patchouli', '888.00', '0.00', NULL, NULL, 'no', 'no', 'no', NULL, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '9', NULL, 'Simple', NULL, NULL, NULL, NULL, 'Catalog', 40, 'active', 'alwaysInStock', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2022-07-05 10:50:20', NULL, '2022-07-27 13:52:33'),
(1261, 30, 'RM003', 'No.3 edp 100 ml', 'no.3-edp-100-ml-16', NULL, 'Rosendo Mateu N° 3 is a noble and elegant scent worked with natural Iris for its strong element of sophistication and value.\r\n', '\"Rosendo Mateu N° 3 is an Italian Iris fragrance, with its top note of fresh citrus from Calabrian bergamot and neroli essential oil from Tunisia, is a noble and elegant scent worked with natural Iris for its strong element of sophistication and value.\r\n\r\nSandalwood, vetiver, and the lingering tasty aspect of amber cashmere with tonka beans and vanilla give that touch of elegance and sensuality that will seduce the most demanding public. \"\r\n', NULL, 'Tunisian Neroli and Sicilian Bergamot', 'Iris, Jasmine and Damask Rose', 'White Musk, Vetiver, Sandalwood, Vanilla, Cashmere Wood, Tonka Bean and Amber', '888.00', '0.00', NULL, NULL, 'no', 'no', 'no', NULL, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '9', NULL, 'Simple', NULL, NULL, NULL, NULL, 'Catalog', 90, 'active', 'alwaysInStock', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2022-07-05 10:51:50', NULL, '2022-07-27 13:53:18'),
(1262, 30, 'RM004', 'No.4 EDP 100 ml', 'no.4-edp-100-ml-16', NULL, 'Rosendo Mateu N°4 is a luxuriant and sensual perfume. The intense scent of this oriental fragrance is inspired by Oud, with notes such as nutmeg, nuts, saffron, cinnamon, and hints of wood, sandalwood, and guaiac.\r\n', '\"Rosendo Mateu N°4 is a sensual, powerful perfume, with a scent that is unmistakably inspired by Oud.\r\n\r\nOud fantasy combination of nutmeg, nuts, saffron, cinnamon, and hints of wood, sandalwood, and guaiac.\r\n\r\nThe eastern intensity is provided by labdanum, benzoin, and vanilla with amber notes.\"\r\n', NULL, 'Orange Blossom and Calabrian bergamot', 'Saffron, Nutmeg, Cinnamon, Jasmine and iris', 'Agarwood (Oud), Vanilla, Guaiac Wood, Vetiver, Labdanum, Tonka Bean, Benzoin, Sandalwood, Patchouli and Musk', '888.00', '0.00', NULL, NULL, 'no', 'no', 'no', NULL, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '9', NULL, 'Simple', NULL, NULL, NULL, NULL, 'Catalog', 50, 'active', 'alwaysInStock', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2022-07-05 10:53:46', NULL, '2022-07-27 13:55:22'),
(1263, 30, 'RM005', 'No.5 edp 100 ml', 'no.5-edp-100-ml-16', NULL, 'Forget about the simple mundane perfumes and take a trip with Rosendo Mateu N°5. This exotic oriental fragrance will take you to a higher level of fulfilment.\r\n', '\"Rosendo Mateu N°5 is an exotic and different flower that does not exist in nature, like a dream in a fragrance.\r\n\r\nExotic floral oriental fragrance, spicy, carnation, and lily of the valley flower combination.\r\n\r\nBase notes are vanilla, sensual amber musk, with a fresh oriental style.\"\r\n', NULL, 'Exotic floral notes and Spices', 'Carnation and Lily-of-the-Valley', 'Amber, Vanilla and Musk', '888.00', '0.00', NULL, NULL, 'yes', 'no', 'no', NULL, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '9', NULL, 'Simple', NULL, NULL, NULL, NULL, 'Catalog', 10, 'active', 'alwaysInStock', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2022-07-05 10:56:04', NULL, '2022-07-27 13:56:26'),
(1264, 30, 'RM006', 'No.6 EDP 100 ml', 'no.6-edp-100-ml-16', NULL, 'Rosendo Mateu N°6 is a combination that will surprise the most exquisite noses. All the notes are fixed on the skin with White Musc of the best quality.', '\"Sandalwood nobility from India is the main note of this floral, sweet, and soft fragrance.\r\n\r\nOpens with the delicateness and freshness of the Sambac Jasmin flower and Amber and Vanilla notes bring persistence and sensuality to the skin. A combination that will surprise the most exquisite noses.\r\n\r\nAll the notes are fixed to the skin with white Musk of the best quality.\"\r\n', NULL, 'Exotic Fruits, Jasmine Sambac, Floral Notes, Coconut and Green Accord', 'Sandalwood and Spicy Notes', 'White Musk, Vanilla and Amber', '888.00', '0.00', NULL, NULL, 'no', 'no', 'no', NULL, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '9', NULL, 'Simple', NULL, NULL, NULL, NULL, 'Catalog', 60, 'active', 'alwaysInStock', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2022-07-05 10:58:03', NULL, '2022-07-27 13:57:25'),
(1265, 30, 'RM007', 'No.7 edp 100 ml', 'no.7-edp-100-ml-16', NULL, 'The delicate top note of rose petals blends quickly with the heart of this alluring perfume. The main hero of the fragrance - patchouli from Indonesia, it is distilled for long hours to achieve the excellent quality of the raw materials. Floral jasmine notes take centre stage, followed by high-quality oud, vanilla, and benzoin in the background\r\n', 'Rosendo Mateu 7 has a very delicate floral top note of rose petals that blend quickly with the middle notes of the fragrance. The protagonist of this creation is the patchouli extracted in the fields of Indonesia, where its leaves are left to dry and later irrigated with water to ferment and distil for long hours in iron stills. The patchouli that we use in our fragrance is obtained by a molecular distillation process where we can achieve the highest possible quality of this raw material. The middle notes are made up of spicy and floral notes such as jasmine that takes on great prominence with animal touches. The background elements are a blend of high-quality Laos and Thai ouds with vanilla absolute from Madagascar and Benjui from Siam. Rosendo Mateu and his son Joan, have worked for more than two years in this creation that we hope will please our friends and loyal customers. It is a very addictive, original and unique project.\r\n', NULL, 'Rose petals, fresh flowers', 'Jasmine, spices, patchouli, Gourmand', 'Laos Oud, Thai Oud, Vanilla, Siam Benzoin', '888.00', '0.00', NULL, NULL, 'yes', 'no', 'no', NULL, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '9', NULL, 'Simple', NULL, NULL, NULL, NULL, 'Catalog', 20, 'active', 'alwaysInStock', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2022-07-05 10:59:29', NULL, '2022-07-27 13:57:46'),
(1266, 30, 'RMBCSR', 'Sweet Rose EDP 100 ml', 'sweet-rose-edp-100-ml-22', NULL, 'Rose is the most interpreted flower in perfumery for many applications. This composition tries to develop the opulent note of Arabic rose, with Bulgarian rose, dry Turkish rose petals, and geranium\r\n', '\"Rose is the most interpreted flower in perfumery for many applications. \r\n\r\nThis composition tries to develop the opulent note of Arabic rose, with Bulgarian rose, dry Turkish rose petals, and geranium.\r\n\r\nThe top notes introduces natural bergamot from Calabria in Italy and Citric accords.\r\n\r\nMiddle notes are woody notes, Indian sandalwood, patchouli, and vetiver. The sweet notes are fruity as strawberries, berries, and passion fruit, which gives sensuality and a touch of freshness to the perfume. \r\n\r\nThe base notes are a blending of white sensual musk and vanilla which gives persistence to the composition.\"\r\n', NULL, 'Passionfruit, Strawberry, Red Berries, Raspberry, Green Leaves and, Calabrian bergamot', 'Rose, Bulgarian Rose, Turkish Rose, and Geranium', 'White Musk, Musk, Vanilla, Cedar, Sandalwood, and Vetiver', '1103.00', '0.00', NULL, NULL, 'no', 'no', 'no', NULL, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '9', NULL, 'Simple', NULL, NULL, NULL, NULL, 'Catalog', 100, 'inactive', 'alwaysInStock', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2022-07-05 11:02:49', NULL, '2022-08-23 16:22:23'),
(1267, 30, 'RMBCIW', 'Incense Wood edp 100 ml', 'incense-wood-edp-100-ml-24', NULL, 'Incense Wood is a sensual fragrance with very sophisticated incense and spicy and oriental notes. This composition remains on the skin attractive, sensual, and with a lot of character.', '\"A sensual fragrance with a very sophisticated incense, and spicy and oriental notes. The top notes perfectly combine spicy and fresh incense notes, with a molecularly distilled incense heart, natural bergamot from Italy, cardamom, Madagascar cloves, and Ceylan cinnamon.\r\n\r\nThe middle notes of this fragrance continue with album sandalwood, patchouli leaves, and rosewood from Brasil.\r\n\r\nThe base notes are a blending of incense resins and tonka beans, with amber, labdanum notes, oriental vanilla absolute from Madagascar, and white musk. This composition remains on the skin attractive, sensual, and with a lot of character.\"\r\n', NULL, 'Ceylon Cinnamon, Cardamom, Madagascar Cloves, Bergamot and Citruses', 'Incense, Sandalwood, Palisander Rosewood and Patchouli Leaf', 'Vanilla, Tonka Bean, Amber, Labdanum, Musk and White Musk', '1103.00', '0.00', NULL, NULL, 'no', 'no', 'no', NULL, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '9', NULL, 'Simple', NULL, NULL, NULL, NULL, 'Catalog', 110, 'inactive', 'alwaysInStock', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2022-07-05 11:05:13', NULL, '2022-08-23 16:22:16'),
(1268, 30, 'RMBCFO', 'Fresh Oud edp 100 ml', 'fresh-oud-edp-100-ml-21', NULL, 'Rosendo Mateu Fresh Oud is a very qualitative fragrance inspired and created to surprise all oud lovers', '\"Rosendo Mateu Fresh Oud includes a fresh, sensual, powerful, and attractive note of oud oil. Stands out as the original smell of qualitative natural oud with some fresh and floral aspects that adapts perfectly to the skin.\r\n\r\nThe top notes of the fragrance are natural bergamot (from Calabria in Italy with bitter grapefruit) spicy notes like cardamom, saffron, and cinnamon bark. Continues with floral middle notes with white Jasmine, natural Bulgarian rose and powdery and creamy notes, and natural Iris. Oud notes accord with sandalwood, cedarwood, patchouli leaves, amber, leather, cashmere, vanilla, and white musk.\r\n\r\nA very qualitative fragrance inspired and created to surprise all oud lovers.\"\r\n', NULL, 'Grapefruit, Bergamot, Cardamom, Saffron and Ceylon Cinnamon', 'Agarwood (Oud), iris, Jasmine and Bulgarian Rose', 'Leather, Sandalwood, Cashmere Wood, Vanilla, Cedar, White Musk, Amber and Patchouli', '1103.00', '0.00', NULL, NULL, 'no', 'no', 'no', NULL, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '9', NULL, 'Simple', NULL, NULL, NULL, NULL, 'Catalog', 120, 'inactive', 'alwaysInStock', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2022-07-05 11:06:53', NULL, '2022-08-23 16:22:20'),
