(1285, 30, 'CM100', 'Chypre Mojo 45 edp 100 ml', 'chypre-mojo-45-edp-100-ml-26', NULL, 'Chypre Mojo is the embodiment of sex appeal, triggering an instant addiction to its bergamot, carnation, mango and patchouli accord.\r\n', '\"Chypre Mojo / 45: Chypre refers to a kind of perfumes, a sharp contrast between different olfactory families like flowers, citrus, fruits, and woods mainly based on Patchouli and Moss.\r\nFirst created by François Coty in 1917, it’s a century after that we decided to launch our vision of the Chypre. Chypre Mojo is a blend of Bergamot from Italy, Mango, Carnations, and Patchouli (from the Philippines or Indonesia). It results from the idea to create a fruity and generous, addictive, and long-lasting scent, that could be worn both by women and men and results from the current global trend of fruity scents.\r\nThe scent evolves very slightly and the freshness remains almost the same for a couple of hours. Mojo refers to the luck, the luck you may have at work, in your relationships, etc. It’s the scent for great occasions.\"\r\n', NULL, '', '', '', '741.00', '0.00', NULL, NULL, 'no', 'no', 'no', NULL, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '11', NULL, 'Simple', NULL, NULL, NULL, NULL, 'Catalog', 10, 'active', 'alwaysInStock', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2022-07-05 12:05:44', NULL, '2022-07-27 17:38:27'),
(1286, 30, 'FV100', 'Flavia Vanilla 82 edp 100 ml', 'flavia-vanilla-82-edp-100-ml-29', NULL, 'Flavia is a dark and sugary vanilla. Sweet, fascinating and totally seductive.\r\n', '\"Flavia Vanilla / 82: a fresh-fruity-flowery creation around Ylang-Ylang Absolute from NocibeIsland (called LysYlangbecause when you make a solvent extraction of Ylang, there is a side of Lily scent inside), Michelia(Magnolia Family), Peach (from a synthetic ingredient called « AldéhydeC14 ») that brings a fresh side and Vanilla (Vanillin).\r\nPeople love it because it’s vanilla that doesn’t smell the classic vanilla.\r\nFlavia is an Italian girl that Michel used to know when he was young before meeting his wife, and she was smelling this dark and sugary vanilla he tried to re-create almost 40 years after. Maybe the most feminine perfume of the collection.\r\nShould be tried on the skin, where it develops all its power and freshness.\"\r\n', NULL, '', '', '', '741.00', '0.00', NULL, NULL, 'no', 'no', 'no', NULL, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '11', NULL, 'Simple', NULL, NULL, NULL, NULL, 'Catalog', 40, 'active', 'alwaysInStock', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2022-07-05 12:09:06', NULL, '2022-07-27 17:35:02'),
(1287, 30, 'MM100', 'Milky Musk 39 edp 100 ml', 'milky-musk-39-edp-100-ml-25', NULL, 'Rare wood in a pool of musk. Supple and unctuous, musk and sandalwood hug the skin, becoming one with it. Milky Musk becomes your olfactory shadow, flowing and elusive, evolving throughout the day.\r\n', '\"Milky Musk / 39 : one of the two pure-unisex perfumes of the collection, constructed\r\naround a special Sandalwood (top-secret origin), a Musk called Ambrettolide(the muskypartof Ambrette, a plant from South-America) and the milk of the Fig (synthetic).\r\nIt’s a confortableand smooth mix that needs a couple of minutes to develop itself and reveal its identity. If the two first ingredients are amongst the most-expensive ones in the industry, the milk of the Fig is the innovation because it marks the change with older fig perfumes created around another ingredient called Stemonewhich has a strong green fig –fig leaves aspect.\r\nCertainly one of the best-sellers of the collection, don’t hesitate to propose it to all,\r\nincluding people who wants to smell strong woody/oud perfumes, they will be satisfied with this deep smooth woody and less animalistic mix.\"\r\n', NULL, '', '', '', '741.00', '0.00', NULL, NULL, 'yes', 'no', 'no', NULL, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '11', NULL, 'Simple', NULL, NULL, NULL, NULL, 'Catalog', 20, 'active', 'alwaysInStock', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2022-07-05 12:11:18', NULL, '2022-07-27 17:37:02'),
(1288, 30, 'WP100', 'Woody Perfecto 107 edp 100 ml', 'woody-perfecto-107-edp-100-ml-30', NULL, 'Woody Perfecto symbolizes freedom. It is the fragrant key to a horizon that knows no limits.\r\n', '\"Woody Perfecto / 107: Vetiver (roots of a small bush/grass from Haïti), Elemi (a gum from the Philippines, imagine a mix between Lemon, Pink Peppercorn, and Incense and you’ll smell the Elemi scent), and Homofuronol(a synthetic ingredient that smells like MokaCoffee, alcoholic drinks like Irish Coffee, Baileys, etc.).\r\nA modern tobacco-leathery mix built from the idea of popularizing again the Vetiver. It’s fresh and spicy on the top note, warm, woody, and incense in the middle and base note. Can also be worn both by women and men.\"\r\n', NULL, '', '', '', '741.00', '0.00', NULL, NULL, 'no', 'no', 'no', NULL, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '11', NULL, 'Simple', NULL, NULL, NULL, NULL, 'Catalog', 30, 'active', 'alwaysInStock', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2022-07-05 12:14:20', NULL, '2022-07-27 17:32:54'),
