(1296, 30, 'MICOFF0405', 'PLUSH EDP + PLUSH HAIR PERFUME GIFT SET', 'plush-edp-+-plush-hair-perfume-gift-set-40', NULL, 'Plush extrait de parfum 75ml with Plush hair perfume 75ml with a beautiful EID MUBARAK Sleeves is a perfect gift for your loved ones.', 'Plush is a quality we appreciate in all things we like to touch- and especially true when thinking of cashmere, velvet, and silk. Vanilla, jasmine & orange blossom are carefully blended into a bouquet of luxurious musks & finished with a dose of ambergris.\r\n\r\n', NULL, '', '', '', '1199.00', '0.00', NULL, NULL, 'no', 'no', 'no', NULL, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '8', NULL, 'Simple', NULL, NULL, NULL, NULL, 'Catalog', 110, 'active', 'alwaysInStock', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2022-07-05 14:03:59', NULL, '2022-08-11 11:26:57'),
(1297, 30, 'MICOFF0406', 'CODA EDP + CODA HAIR PERFUME GIFT SET', 'coda-edp-+-coda-hair-perfume-gift-set-38', NULL, 'CODA extrait de parfum 75ml with CODA hair perfume 75ml with a beautiful EID MUBARAK Sleeves is a perfect gift for your loved ones.\r\n', '\"A luminous aldehydic opening contrasts a sensual & smoldering heart. Luscious plums, flowers & woods meet sumptuous leather & musk. CODA leaves you satisfied with a sense of balance. Rock star chic.\r\n\r\nRegardless of the tune of your personal chemistry, this scent is a true soundtrack of attraction. Cooling and warming the wearer’s skin at the same time, Coda is rock star chic, provocative and refined with a bit of edge.\"\r\n', NULL, '', '', '', '1199.00', '0.00', NULL, NULL, 'no', 'no', 'no', NULL, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '8', NULL, 'Simple', NULL, NULL, NULL, NULL, 'Catalog', 100, 'active', 'alwaysInStock', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2022-07-05 14:24:19', NULL, '2022-08-11 11:25:54'),
