(1305, 30, 'EXT0042', 'Nanshe EDP 100 ML', NULL, NULL, NULL, '\"Nanshe is the name of a Sumerian goddess of fertility, water, and social justice, which was believed to be the patron of dreams and prophecy. She watched over orphans and widows, oversaw fairness, freshwater, birds and fish, fertility, and favored prophets, giving them the ability to interpret dreams accurately.\r\n\r\n​The main challenge was to create a scent that reflects the kind, compassionate, welcoming, and wise attributes of this divine figure. With Nanshe, NISHANE wishes for a world where the forgotten, the poor, the lonely, and the disenfranchised are looked after.\r\n\r\nSurrounded by a sublime accord of rose which had been widely reported to help fertility by many civilizations, Nanshe is suggesting poetic emotions with earthy aromas that will mystically conceive the positiveness even in the darkest times.\"\r\n', NULL, NULL, NULL, NULL, '888.00', NULL, NULL, NULL, 'no', 'no', 'no', NULL, NULL, 1222, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '50 ML', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Catalog', NULL, 'active', 'alwaysInStock', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2022-07-22 19:29:52', NULL, '2022-08-29 11:10:34'),
(1306, 30, 'EXT0028', 'HUNDRED SILENT WAYS EDP 100 ML', 'hundred-silent-ways-edp-100-ml-31', NULL, 'Hundred Silent Ways is a tribute to the most-liked perfumes in the history of perfumery with a modern interpretation and blend of pleasant notes.', '\"Hundred Silent Ways Was created as a tribute to the most-liked perfumes in the history of perfumery with a modern interpretation and blend of pleasant notes. With a drop, one would feel wearing the attractiveness of all beautiful souls ever lived on earth and silently share this with everyone he/she encounters. Get ready for the compliments. \'I closed my mouth and spoke to you in a hundred silent ways\' ~Rumi \"', NULL, 'Tuberose, Mandarin, Peach', 'White Jasmin, Gardenia, Orris', 'Vanilla, Sandalwood, Vetiver', '1302.00', '0.00', NULL, NULL, 'yes', 'no', 'no', NULL, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '6', NULL, 'Simple', NULL, NULL, NULL, NULL, 'Catalog', 20, 'active', 'alwaysInStock', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2022-07-26 12:24:18', NULL, '2022-07-28 11:54:34'),
(1307, 30, 'LM16', 'CHARME EDP 100 ML', 'charme-edp-100-ml-18', NULL, 'A poetic walk out of sight, where elegance and refinement are essential.', 'Along the peaceful Lake Como, a flourishing nature intrigues. Hidden behind, the Villa Balbiano is revealed.\r\nArriving from the pontoon, elegant floral notes follow visitors to the private garden, to the rhythm of the water. Guests get lost between ancient statues and beautifully trimmed hedges. A few steps away, the palazzo has remained intact, a witness to Italian history.\r\n\r\nA poetic walk out of sight, where elegance and refinement are essential.', NULL, 'Bergamot Italy, Grapefruit, Blackcurrant', 'Red Rose, Peony, Nutmeg, Incense', 'Blackberry, Pear, White Cedar, Patchouly Indonesia, White amber, Vanilla', '699.00', '0.00', NULL, NULL, 'no', 'no', 'no', NULL, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '7', NULL, 'Simple', NULL, NULL, NULL, NULL, 'Catalog', 500, 'active', 'alwaysInStock', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2022-08-24 11:14:34', NULL, '2022-08-24 11:20:27'),
(1308, 30, 'LM15', 'OMELIE EDP 100 ML', 'omelie-edp-100-ml-18', NULL, 'An odyssey between Heaven and Earth, the Pearl of the Nile is gradually revealed.', 'A summer solstice. The sun rises atop the Temple of Isis, marking a magical moment. The Bird Goddess, Isis gives the “breath of life” in the wind by flapping her wings, bringing the scent of Elemi and Geranium.\r\nShe spreads all her love, a sensual and feminine scent of rose invades the Temple, like a rebirth of the soul. Suddenly, the sun sets, letting the incense take on all its power and open up the fascinating world of dreams.\r\n\r\nAn odyssey between Heaven and Earth, the Pearl of the Nile is gradually revealed.', NULL, 'Freesia, Pink Berries, Elemi', 'Rose essence of Bulgaria, Geranium, Incense', 'Gaiac wood, Papyrus, Santal wood, Oud, Amber, Praline', '699.00', '0.00', NULL, NULL, 'no', 'no', 'no', NULL, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '7', NULL, 'Simple', NULL, NULL, NULL, NULL, 'Catalog', 510, 'active', 'alwaysInStock', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2022-08-24 11:29:58', NULL, '2022-08-24 11:30:59'),
