(19, 30, 'home page', 'home-page', '', '<p>Free Shipping</p>\r\n\r\n<p>On order over 500/-</p>\r\n\r\n<p>Cash on Delivery</p>\r\n\r\n<p>100% money back guarantee</p>\r\n\r\n<p>Special Gift Card</p>\r\n\r\n<p>Offer special bonuses with gift</p>\r\n\r\n<p>24/7 Customer Service</p>\r\n\r\n<p>Call us 24/7 at 123-456-789</p>\r\n', NULL, 'No', NULL, NULL, NULL, '30', '1', '2022-01-19 16:42:34', '2022-09-11 23:36:26'),
(20, 30, 'News', 'news', '', '<h3><strong>PERFUME GIFT SETS</strong></h3>\r\n\r\n<h3>&nbsp;</h3>\r\n\r\n<h3>Mawfoor presents Niche perfume gift sets on the occasion of Eid Al Adha. Order your Gift set at the price of Perfume. Limited time Offer!</h3>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>5th July 2022</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3><strong>NISHANE</strong></h3>\r\n\r\n<p>NISHANE is the first and only Istanbul based niche perfume brand that is celebrated globally with an exceptional point of view on artistic perfumery. This can easily be recognized by the uniqueness of the scent creations.<br />\r\n&nbsp;</p>\r\n\r\n<p>20th June 2022<br />\r\n&nbsp;</p>\r\n', NULL, 'Yes', NULL, NULL, NULL, NULL, '1', '2022-01-21 14:19:57', '2022-07-05 16:54:14'),
(21, 30, 'Terms and Conditions', 'terms-and-conditions', '', '<p><strong>Terms and Conditions</strong></p>\r\n\r\n<p>Last updated: June 30, 2022</p>\r\n\r\n<p>Please read these terms and conditions carefully before using Our Service.</p>\r\n\r\n<p><strong>Interpretation and Definitions</strong></p>\r\n\r\n<p><strong>Interpretation</strong></p>\r\n\r\n<p>The words of which the initial letter is capitalized have meanings defined under the following conditions. The following definitions shall have the same meaning regardless of whether they appear in singular or in plural.</p>\r\n\r\n<p><strong>Definitions</strong></p>\r\n\r\n<p>For the purposes of these Terms and Conditions:</p>\r\n\r\n<ul>\r\n	<li><strong>Affiliate</strong>&nbsp;means an entity that controls, is controlled by or is under common control with a party, where &quot;control&quot; means ownership of 50% or more of the shares, equity interest or other securities entitled to vote for election of directors or other managing authority.</li>\r\n	<li><strong>Country</strong>&nbsp;refers to: United Arab Emirates</li>\r\n	<li><strong>Company</strong>&nbsp;(referred to as either &quot;the Company&quot;, &quot;We&quot;, &quot;Us&quot; or &quot;Our&quot; in this Agreement) refers to Lasting Sillage Perfumes Trading LLC, 901, Lake Central Tower, Marasi Drive, Business Bay, Dubai, UAE.</li>\r\n	<li><strong>Device</strong>&nbsp;means any device that can access the Service such as a computer, a cellphone or a digital tablet.</li>\r\n	<li><strong>Service</strong>&nbsp;refers to the Website.</li>\r\n	<li><strong>Terms and Conditions</strong>&nbsp;(also referred as &quot;Terms&quot;) mean these Terms and Conditions that form the entire agreement between You and the Company regarding the use of the Service. This Terms and Conditions agreement has been created with the help of the&nbsp;<a href=\"https://www.freeprivacypolicy.com/free-terms-and-conditions-generator/\" target=\"_blank\">Free Terms and Conditions Generator</a>.</li>\r\n	<li><strong>Third-party Social Media Service</strong>&nbsp;means any services or content (including data, information, products or services) provided by a third-party that may be displayed, included or made available by the Service.</li>\r\n	<li><strong>Website</strong>&nbsp;refers to Mawfoor, accessible from&nbsp;<a href=\"https://mawfoor.com/\" target=\"_blank\">https://mawfoor.com</a></li>\r\n	<li><strong>You</strong>&nbsp;means the individual accessing or using the Service, or the company, or other legal entity on behalf of which such individual is accessing or using the Service, as applicable.</li>\r\n</ul>\r\n\r\n<p><strong>Acknowledgment</strong></p>\r\n\r\n<p>These are the Terms and Conditions governing the use of this Service and the agreement that operates between You and the Company. These Terms and Conditions set out the rights and obligations of all users regarding the use of the Service.</p>\r\n\r\n<p>Your access to and use of the Service is conditioned on Your acceptance of and compliance with these Terms and Conditions. These Terms and Conditions apply to all visitors, users and others who access or use the Service.</p>\r\n\r\n<p>By accessing or using the Service You agree to be bound by these Terms and Conditions. If You disagree with any part of these Terms and Conditions then You may not access the Service.</p>\r\n\r\n<p>You represent that you are over the age of 18. The Company does not permit those under 18 to use the Service.</p>\r\n\r\n<p>Your access to and use of the Service is also conditioned on Your acceptance of and compliance with the Privacy Policy of the Company. Our Privacy Policy describes Our policies and procedures on the collection, use and disclosure of Your personal information when You use the Application or the Website and tells You about Your privacy rights and how the law protects You. Please read Our Privacy Policy carefully before using Our Service.</p>\r\n\r\n<p><strong>Links to Other Websites</strong></p>\r\n\r\n<p>Our Service may contain links to third-party web sites or services that are not owned or controlled by the Company.</p>\r\n\r\n<p>The Company has no control over, and assumes no responsibility for, the content, privacy policies, or practices of any third party web sites or services. You further acknowledge and agree that the Company shall not be responsible or liable, directly or indirectly, for any damage or loss caused or alleged to be caused by or in connection with the use of or reliance on any such content, goods or services available on or through any such web sites or services.</p>\r\n\r\n<p>We strongly advise You to read the terms and conditions and privacy policies of any third-party web sites or services that You visit.</p>\r\n\r\n<p><strong>Termination</strong></p>\r\n\r\n<p>We may terminate or suspend Your access immediately, without prior notice or liability, for any reason whatsoever, including without limitation if You breach these Terms and Conditions.</p>\r\n\r\n<p>Upon termination, Your right to use the Service will cease immediately.</p>\r\n\r\n<p><strong>Limitation of Liability</strong></p>\r\n\r\n<p>Notwithstanding any damages that You might incur, the entire liability of the Company and any of its suppliers under any provision of this Terms and Your exclusive remedy for all of the foregoing shall be limited to the amount actually paid by You through the Service or 100 USD if You haven&#39;t purchased anything through the Service.</p>\r\n\r\n<p>To the maximum extent permitted by applicable law, in no event shall the Company or its suppliers be liable for any special, incidental, indirect, or consequential damages whatsoever (including, but not limited to, damages for loss of profits, loss of data or other information, for business interruption, for personal injury, loss of privacy arising out of or in any way related to the use of or inability to use the Service, third-party software and/or third-party hardware used with the Service, or otherwise in connection with any provision of this Terms), even if the Company or any supplier has been advised of the possibility of such damages and even if the remedy fails of its essential purpose.</p>\r\n\r\n<p>Some states do not allow the exclusion of implied warranties or limitation of liability for incidental or consequential damages, which means that some of the above limitations may not apply. In these states, each party&#39;s liability will be limited to the greatest extent permitted by law.</p>\r\n\r\n<p><strong>&quot;AS IS&quot; and &quot;AS AVAILABLE&quot; Disclaimer</strong></p>\r\n\r\n<p>The Service is provided to You &quot;AS IS&quot; and &quot;AS AVAILABLE&quot; and with all faults and defects without warranty of any kind. To the maximum extent permitted under applicable law, the Company, on its own behalf and on behalf of its Affiliates and its and their respective licensors and service providers, expressly disclaims all warranties, whether express, implied, statutory or otherwise, with respect to the Service, including all implied warranties of merchantability, fitness for a particular purpose, title and non-infringement, and warranties that may arise out of course of dealing, course of performance, usage or trade practice. Without limitation to the foregoing, the Company provides no warranty or undertaking, and makes no representation of any kind that the Service will meet Your requirements, achieve any intended results, be compatible or work with any other software, applications, systems or services, operate without interruption, meet any performance or reliability standards or be error free or that any errors or defects can or will be corrected.</p>\r\n\r\n<p>Without limiting the foregoing, neither the Company nor any of the company&#39;s provider makes any representation or warranty of any kind, express or implied: (i) as to the operation or availability of the Service, or the information, content, and materials or products included thereon; (ii) that the Service will be uninterrupted or error-free; (iii) as to the accuracy, reliability, or currency of any information or content provided through the Service; or (iv) that the Service, its servers, the content, or e-mails sent from or on behalf of the Company are free of viruses, scripts, trojan horses, worms, malware, timebombs or other harmful components.</p>\r\n\r\n<p>Some jurisdictions do not allow the exclusion of certain types of warranties or limitations on applicable statutory rights of a consumer, so some or all of the above exclusions and limitations may not apply to You. But in such a case the exclusions and limitations set forth in this section shall be applied to the greatest extent enforceable under applicable law.</p>\r\n\r\n<p><strong>Governing Law</strong></p>\r\n\r\n<p>The laws of the Country, excluding its conflicts of law rules, shall govern this Terms and Your use of the Service. Your use of the Application may also be subject to other local, state, national, or international laws.</p>\r\n\r\n<p><strong>Disputes Resolution</strong></p>\r\n\r\n<p>If You have any concern or dispute about the Service, You agree to first try to resolve the dispute informally by contacting the Company.</p>\r\n\r\n<p><strong>For European Union (EU) Users</strong></p>\r\n\r\n<p>If You are a European Union consumer, you will benefit from any mandatory provisions of the law of the country in which you are resident in.</p>\r\n\r\n<p><strong>United States Legal Compliance</strong></p>\r\n\r\n<p>You represent and warrant that (i) You are not located in a country that is subject to the United States government embargo, or that has been designated by the United States government as a &quot;terrorist supporting&quot; country, and (ii) You are not listed on any United States government list of prohibited or restricted parties.</p>\r\n\r\n<p><strong>Severability and Waiver</strong></p>\r\n\r\n<p><strong>Severability</strong></p>\r\n\r\n<p>If any provision of these Terms is held to be unenforceable or invalid, such provision will be changed and interpreted to accomplish the objectives of such provision to the greatest extent possible under applicable law and the remaining provisions will continue in full force and effect.</p>\r\n\r\n<p><strong>Waiver</strong></p>\r\n\r\n<p>Except as provided herein, the failure to exercise a right or to require performance of an obligation under these Terms shall not effect a party&#39;s ability to exercise such right or require such performance at any time thereafter nor shall the waiver of a breach constitute a waiver of any subsequent breach.</p>\r\n\r\n<p><strong>Translation Interpretation</strong></p>\r\n\r\n<p>These Terms and Conditions may have been translated if We have made them available to You on our Service. You agree that the original English text shall prevail in the case of a dispute.</p>\r\n\r\n<p><strong>Changes to These Terms and Conditions</strong></p>\r\n\r\n<p>We reserve the right, at Our sole discretion, to modify or replace these Terms at any time. If a revision is material We will make reasonable efforts to provide at least 30 days&#39; notice prior to any new terms taking effect. What constitutes a material change will be determined at Our sole discretion.</p>\r\n\r\n<p>By continuing to access or use Our Service after those revisions become effective, You agree to be bound by the revised terms. If You do not agree to the new terms, in whole or in part, please stop using the website and the Service.</p>\r\n\r\n<p><strong>Contact Us</strong></p>\r\n\r\n<p>If you have any questions about these Terms and Conditions, You can contact us:</p>\r\n\r\n<ul>\r\n	<li>By email:&nbsp;customercare@mawfoor.com</li>\r\n</ul>\r\n', NULL, 'Yes', NULL, NULL, NULL, NULL, '1', '2022-01-21 15:33:39', '2022-06-30 21:52:12'),
(22, 30, 'About Us', 'about-us', '', '<h3>About Us</h3>\r\n\r\n<p><br />\r\nMawfoor is an E-commerce platform dedicated to exclusive luxury fragrances, offering the convenience of buying online without any hassle and is completely reliable. We aim to offer you a lavish and enchanting experience. To achieve this, we offer genuine niche fragrances from selective companies around the world. All our products are authentically sourced from authorized distributors and can be trusted for their quality, and uniqueness. Our team of experts believes that fragrance needs are deeply emotional and personal &ndash; we thus focus on a deep understanding of the desires of our customers before offering them the best possible options in niche perfumes.</p>\r\n\r\n<p>Mission</p>\r\n\r\n<p>Our mission is to bring home the best in niche perfumes, delivering essential and authentic fragrances to the discerning clientele.</p>\r\n\r\n<p>Vision</p>\r\n\r\n<p>Our vision is to be the leading E-commerce platform for exclusive niche perfumes in the UAE.</p>\r\n\r\n<p>Credo</p>\r\n\r\n<p>We believe in educating our customers, creating trust through transparency, adapting to their needs, and improving the flow of our products.</p>\r\n', NULL, 'Yes', NULL, NULL, NULL, NULL, '1', '2022-01-21 15:33:01', '2022-09-04 11:36:17'),
(23, 30, 'Privacy Policy', 'privacy-policy', '', '<p><strong>Privacy Policy</strong></p>\r\n\r\n<p>Last updated: June 30, 2022</p>\r\n\r\n<p>This Privacy Policy describes Our policies and procedures on the collection, use, and disclosure of Your information when You use the Service and tells You about Your privacy rights and how the law protects You.</p>\r\n\r\n<p>We use Your Personal data to provide and improve the Service. By using the Service, You agree to the collection and use of information in accordance with this Privacy Policy. This Privacy Policy has been created with the help of the&nbsp;<a href=\"https://www.freeprivacypolicy.com/free-privacy-policy-generator/\" target=\"_blank\">Free Privacy Policy Generator</a>.</p>\r\n\r\n<p><strong>Interpretation and Definitions</strong></p>\r\n\r\n<p><strong>Interpretation</strong></p>\r\n\r\n<p>The words of which the initial letter is capitalized have meanings defined under the following conditions. The following definitions shall have the same meaning regardless of whether they appear in singular or in plural.</p>\r\n\r\n<p><strong>Definitions</strong></p>\r\n\r\n<p>For the purposes of this Privacy Policy:</p>\r\n\r\n<ul>\r\n	<li><strong>Account</strong>&nbsp;means a unique account created for You to access our Service or parts of our Service.</li>\r\n	<li><strong>Company</strong>&nbsp;(referred to as either &quot;the Company&quot;, &quot;We&quot;, &quot;Us&quot; or &quot;Our&quot; in this Agreement) refers to Lasting Sillage Perfumes Trading LLC, 901, Lake Central Tower, Marasi Drive, Dubai, UAE.</li>\r\n	<li><strong>Cookies</strong>&nbsp;are small files that are placed on Your computer, mobile device or any other device by a website, containing the details of Your browsing history on that website among its many uses.</li>\r\n	<li><strong>Country</strong>&nbsp;refers to: United Arab Emirates</li>\r\n	<li><strong>Device</strong>&nbsp;means any device that can access the Service such as a computer, a cellphone or a digital tablet.</li>\r\n	<li><strong>Personal Data</strong>&nbsp;is any information that relates to an identified or identifiable individual.</li>\r\n	<li><strong>Service</strong>&nbsp;refers to the Website.</li>\r\n	<li><strong>Service Provider</strong>&nbsp;means any natural or legal person who processes the data on behalf of the Company. It refers to third-party companies or individuals employed by the Company to facilitate the Service, to provide the Service on behalf of the Company, to perform services related to the Service or to assist the Company in analyzing how the Service is used.</li>\r\n	<li><strong>Third-party Social Media Service</strong>&nbsp;refers to any website or any social network website through which a User can log in or create an account to use the Service.</li>\r\n	<li><strong>Usage Data</strong>&nbsp;refers to data collected automatically, either generated by the use of the Service or from the Service infrastructure itself (for example, the duration of a page visit).</li>\r\n	<li><strong>Website</strong>&nbsp;refers to Mawfoor, accessible from&nbsp;<a href=\"https://mawfoor.com/\" target=\"_blank\">https://mawfoor.com</a></li>\r\n	<li><strong>You</strong>&nbsp;means the individual accessing or using the Service, or the company, or other legal entity on behalf of which such individual is accessing or using the Service, as applicable.</li>\r\n</ul>\r\n\r\n<p><strong>Collecting and Using Your Personal Data</strong></p>\r\n\r\n<p><strong>Types of Data Collected</strong></p>\r\n\r\n<p><strong>Personal Data</strong></p>\r\n\r\n<p>While using Our Service, We may ask You to provide Us with certain personally identifiable information that can be used to contact or identify You. Personally identifiable information may include, but is not limited to:</p>\r\n\r\n<ul>\r\n	<li>Email address</li>\r\n	<li>First name and last name</li>\r\n	<li>Phone number</li>\r\n	<li>Address, State, Province, ZIP/Postal code, City</li>\r\n	<li>Usage Data</li>\r\n</ul>\r\n\r\n<p><strong>Usage Data</strong></p>\r\n\r\n<p>Usage Data is collected automatically when using the Service.</p>\r\n\r\n<p>Usage Data may include information such as Your Device&#39;s Internet Protocol address (e.g. IP address), browser type, browser version, the pages of our Service that You visit, the time and date of Your visit, the time spent on those pages, unique device identifiers and other diagnostic data.</p>\r\n\r\n<p>When You access the Service by or through a mobile device, We may collect certain information automatically, including, but not limited to, the type of mobile device You use, Your mobile device unique ID, the IP address of Your mobile device, Your mobile operating system, the type of mobile Internet browser You use, unique device identifiers and other diagnostic data.</p>\r\n\r\n<p>We may also collect information that Your browser sends whenever You visit our Service or when You access the Service by or through a mobile device.</p>\r\n\r\n<p><strong>Information from Third-Party Social Media Services</strong></p>\r\n\r\n<p>The Company allows You to create an account and log in to use the Service through the following Third-party Social Media Services:</p>\r\n\r\n<ul>\r\n	<li>Google</li>\r\n	<li>Facebook</li>\r\n	<li>Twitter</li>\r\n	<li>LinkedIn</li>\r\n</ul>\r\n\r\n<p>If You decide to register through or otherwise grant us access to a Third-Party Social Media Service, We may collect Personal data that is already associated with Your Third-Party Social Media Service&#39;s account, such as Your name, Your email address, Your activities or Your contact list associated with that account.</p>\r\n\r\n<p>You may also have the option of sharing additional information with the Company through Your Third-Party Social Media Service&#39;s account. If You choose to provide such information and Personal Data, during registration or otherwise, You are giving the Company permission to use, share, and store it in a manner consistent with this Privacy Policy.</p>\r\n\r\n<p><strong>Tracking Technologies and Cookies</strong></p>\r\n\r\n<p>We use Cookies and similar tracking technologies to track the activity on Our Service and store certain information. Tracking technologies used are beacons, tags, and scripts to collect and track information and to improve and analyze Our Service. The technologies We use may include:</p>\r\n\r\n<ul>\r\n	<li><strong>Cookies or Browser Cookies.</strong>&nbsp;A cookie is a small file placed on Your Device. You can instruct Your browser to refuse all Cookies or to indicate when a Cookie is being sent. However, if You do not accept Cookies, You may not be able to use some parts of our Service. Unless you have adjusted Your browser setting so that it will refuse Cookies, our Service may use Cookies.</li>\r\n	<li><strong>Flash Cookies.</strong>&nbsp;Certain features of our Service may use local stored objects (or Flash Cookies) to collect and store information about Your preferences or Your activity on our Service. Flash Cookies are not managed by the same browser settings as those used for Browser Cookies. For more information on how You can delete Flash Cookies, please read &quot;Where can I change the settings for disabling, or deleting local shared objects?&quot; available at&nbsp;<a href=\"https://helpx.adobe.com/flash-player/kb/disable-local-shared-objects-flash.html#main_Where_can_I_change_the_settings_for_disabling__or_deleting_local_shared_objects_\" target=\"_blank\">https://helpx.adobe.com/flash-player/kb/disable-local-shared-objects-flash.html#main_Where_can_I_change_the_settings_for_disabling__or_deleting_local_shared_objects_</a></li>\r\n	<li><strong>Web Beacons.</strong>&nbsp;Certain sections of our Service and our emails may contain small electronic files known as web beacons (also referred to as clear gifs, pixel tags, and single-pixel gifs) that permit the Company, for example, to count users who have visited those pages or opened an email and for other related website statistics (for example, recording the popularity of a certain section and verifying system and server integrity).</li>\r\n</ul>\r\n\r\n<p>Cookies can be &quot;Persistent&quot; or &quot;Session&quot; Cookies. Persistent Cookies remain on Your personal computer or mobile device when You go offline, while Session Cookies are deleted as soon as You close Your web browser. Learn more about cookies on the&nbsp;<a href=\"https://www.freeprivacypolicy.com/blog/sample-privacy-policy-template/#Use_Of_Cookies_And_Tracking\" target=\"_blank\">Free Privacy Policy website</a>&nbsp;article.</p>\r\n\r\n<p>We use both Session and Persistent Cookies for the purposes set out below:</p>\r\n\r\n<ul>\r\n	<li><strong>Necessary / Essential Cookies</strong></li>\r\n</ul>\r\n\r\n<p>Type: Session Cookies</p>\r\n\r\n<p>Administered by: Us</p>\r\n\r\n<p>Purpose: These Cookies are essential to provide You with services available through the Website and to enable You to use some of its features. They help to authenticate users and prevent fraudulent use of user accounts. Without these Cookies, the services that You have asked for cannot be provided, and We only use these Cookies to provide You with those services.</p>\r\n\r\n<ul>\r\n	<li><strong>Cookies Policy / Notice Acceptance Cookies</strong></li>\r\n</ul>\r\n\r\n<p>Type: Persistent Cookies</p>\r\n\r\n<p>Administered by: Us</p>\r\n\r\n<p>Purpose: These Cookies identify if users have accepted the use of cookies on the Website.</p>\r\n\r\n<ul>\r\n	<li><strong>Functionality Cookies</strong></li>\r\n</ul>\r\n\r\n<p>Type: Persistent Cookies</p>\r\n\r\n<p>Administered by: Us</p>\r\n\r\n<p>Purpose: These Cookies allow us to remember choices You make when You use the Website, such as remembering your login details or language preference. The purpose of these Cookies is to provide You with a more personal experience and to avoid You having to re-enter your preferences every time You use the Website.</p>\r\n\r\n<p>For more information about the cookies we use and your choices regarding cookies, please visit our Cookies Policy or the Cookies section of our Privacy Policy.</p>\r\n\r\n<p><strong>Use of Your Personal Data</strong></p>\r\n\r\n<p>The Company may use Personal Data for the following purposes:</p>\r\n\r\n<ul>\r\n	<li><strong>To provide and maintain our Service</strong>, including to monitor the usage of our Service.</li>\r\n	<li><strong>To manage Your Account:</strong>&nbsp;to manage Your registration as a user of the Service. The Personal Data You provide can give You access to different functionalities of the Service that are available to You as a registered user.</li>\r\n	<li><strong>For the performance of a contract:</strong>&nbsp;the development, compliance and undertaking of the purchase contract for the products, items or services You have purchased or of any other contract with Us through the Service.</li>\r\n	<li><strong>To contact You:</strong>&nbsp;To contact You by email, telephone calls, SMS, or other equivalent forms of electronic communication, such as a mobile application&#39;s push notifications regarding updates or informative communications related to the functionalities, products or contracted services, including the security updates, when necessary or reasonable for their implementation.</li>\r\n	<li><strong>To provide You</strong>&nbsp;with news, special offers and general information about other goods, services and events which we offer that are similar to those that you have already purchased or enquired about unless You have opted not to receive such information.</li>\r\n	<li><strong>To manage Your requests:</strong>&nbsp;To attend and manage Your requests to Us.</li>\r\n	<li><strong>For business transfers:</strong>&nbsp;We may use Your information to evaluate or conduct a merger, divestiture, restructuring, reorganization, dissolution, or other sale or transfer of some or all of Our assets, whether as a going concern or as part of bankruptcy, liquidation, or similar proceeding, in which Personal Data held by Us about our Service users is among the assets transferred.</li>\r\n	<li><strong>For other purposes</strong>: We may use Your information for other purposes, such as data analysis, identifying usage trends, determining the effectiveness of our promotional campaigns and to evaluate and improve our Service, products, services, marketing and your experience.</li>\r\n</ul>\r\n\r\n<p>We may share Your personal information in the following situations:</p>\r\n\r\n<ul>\r\n	<li><strong>With Service Providers:</strong>&nbsp;We may share Your personal information with Service Providers to monitor and analyze the use of our Service, to contact You.</li>\r\n	<li><strong>For business transfers:</strong>&nbsp;We may share or transfer Your personal information in connection with, or during negotiations of, any merger, sale of Company assets, financing, or acquisition of all or a portion of Our business to another company.</li>\r\n	<li><strong>With Affiliates:</strong>&nbsp;We may share Your information with Our affiliates, in which case we will require those affiliates to honor this Privacy Policy. Affiliates include Our parent company and any other subsidiaries, joint venture partners or other companies that We control or that are under common control with Us.</li>\r\n	<li><strong>With business partners:</strong>&nbsp;We may share Your information with Our business partners to offer You certain products, services or promotions.</li>\r\n	<li><strong>With other users:</strong>&nbsp;when You share personal information or otherwise interact in the public areas with other users, such information may be viewed by all users and may be publicly distributed outside. If You interact with other users or register through a Third-Party Social Media Service, Your contacts on the Third-Party Social Media Service may see Your name, profile, pictures and description of Your activity. Similarly, other users will be able to view descriptions of Your activity, communicate with You and view Your profile.</li>\r\n	<li><strong>With Your consent</strong>: We may disclose Your personal information for any other purpose with Your consent.</li>\r\n</ul>\r\n\r\n<p><strong>Retention of Your Personal Data</strong></p>\r\n\r\n<p>The Company will retain Your Personal Data only for as long as is necessary for the purposes set out in this Privacy Policy. We will retain and use Your Personal Data to the extent necessary to comply with our legal obligations (for example, if we are required to retain your data to comply with applicable laws), resolve disputes, and enforce our legal agreements and policies.</p>\r\n\r\n<p>The Company will also retain Usage Data for internal analysis purposes. Usage Data is generally retained for a shorter period of time, except when this data is used to strengthen the security or to improve the functionality of Our Service, or We are legally obligated to retain this data for longer time periods.</p>\r\n\r\n<p><strong>Transfer of Your Personal Data</strong></p>\r\n\r\n<p>Your information, including Personal Data, is processed at the Company&#39;s operating offices and in any other places where the parties involved in the processing are located. It means that this information may be transferred to &mdash; and maintained on &mdash; computers located outside of Your state, province, country or other governmental jurisdiction where the data protection laws may differ than those from Your jurisdiction.</p>\r\n\r\n<p>Your consent to this Privacy Policy followed by Your submission of such information represents Your agreement to that transfer.</p>\r\n\r\n<p>The Company will take all steps reasonably necessary to ensure that Your data is treated securely and in accordance with this Privacy Policy and no transfer of Your Personal Data will take place to an organization or a country unless there are adequate controls in place including the security of Your data and other personal information.</p>\r\n\r\n<p><strong>Disclosure of Your Personal Data</strong></p>\r\n\r\n<p><strong>Business Transactions</strong></p>\r\n\r\n<p>If the Company is involved in a merger, acquisition or asset sale, Your Personal Data may be transferred. We will provide notice before Your Personal Data is transferred and becomes subject to a different Privacy Policy.</p>\r\n\r\n<p><strong>Law enforcement</strong></p>\r\n\r\n<p>Under certain circumstances, the Company may be required to disclose Your Personal Data if required to do so by law or in response to valid requests by public authorities (e.g. a court or a government agency).</p>\r\n\r\n<p><strong>Other legal requirements</strong></p>\r\n\r\n<p>The Company may disclose Your Personal Data in the good faith belief that such action is necessary to:</p>\r\n\r\n<ul>\r\n	<li>Comply with a legal obligation</li>\r\n	<li>Protect and defend the rights or property of the Company</li>\r\n	<li>Prevent or investigate possible wrongdoing in connection with the Service</li>\r\n	<li>Protect the personal safety of Users of the Service or the public</li>\r\n	<li>Protect against legal liability</li>\r\n</ul>\r\n\r\n<p><strong>Security of Your Personal Data</strong></p>\r\n\r\n<p>The security of Your Personal Data is important to Us, but remember that no method of transmission over the Internet, or method of electronic storage is 100% secure. While We strive to use commercially acceptable means to protect Your Personal Data, We cannot guarantee its absolute security.</p>\r\n\r\n<p><strong>Children&#39;s Privacy</strong></p>\r\n\r\n<p>Our Service does not address anyone under the age of 13. We do not knowingly collect personally identifiable information from anyone under the age of 13. If You are a parent or guardian and You are aware that Your child has provided Us with Personal Data, please contact Us. If We become aware that We have collected Personal Data from anyone under the age of 13 without verification of parental consent, We take steps to remove that information from Our servers.</p>\r\n\r\n<p>If We need to rely on consent as a legal basis for processing Your information and Your country requires consent from a parent, We may require Your parent&#39;s consent before We collect and use that information.</p>\r\n\r\n<p><strong>Links to Other Websites</strong></p>\r\n\r\n<p>Our Service may contain links to other websites that are not operated by Us. If You click on a third party link, You will be directed to that third party&#39;s site. We strongly advise You to review the Privacy Policy of every site You visit.</p>\r\n\r\n<p>We have no control over and assume no responsibility for the content, privacy policies or practices of any third party sites or services.</p>\r\n\r\n<p><strong>Changes to this Privacy Policy</strong></p>\r\n\r\n<p>We may update Our Privacy Policy from time to time. We will notify You of any changes by posting the new Privacy Policy on this page.</p>\r\n\r\n<p>We will let You know via email and/or a prominent notice on Our Service, prior to the change becoming effective and update the &quot;Last updated&quot; date at the top of this Privacy Policy.</p>\r\n\r\n<p>You are advised to review this Privacy Policy periodically for any changes. Changes to this Privacy Policy are effective when they are posted on this page.</p>\r\n\r\n<p><strong>Contact Us</strong></p>\r\n\r\n<p>If you have any questions about this Privacy Policy, You can contact us:</p>\r\n\r\n<ul>\r\n	<li>By email:&nbsp;customercare@mawfoor.com</li>\r\n</ul>\r\n', NULL, 'Yes', NULL, NULL, NULL, NULL, '1', '2022-01-21 15:31:42', '2022-06-30 21:49:51'),
(31, 30, 'Return and Refund Policy', 'return-and-refund-policy', '', '<p><strong>Return and Refund Policy</strong></p>\r\n\r\n<p>Last updated: June 30, 2022</p>\r\n\r\n<p>Thank you for shopping at Mawfoor.</p>\r\n\r\n<p>If, for any reason, You are not completely satisfied with a purchase We invite You to review our policy on refunds and returns.&nbsp;</p>\r\n\r\n<p>The following terms are applicable for any products that You purchased with Us.</p>\r\n\r\n<p><strong>Interpretation and Definitions</strong></p>\r\n\r\n<p><strong>Interpretation</strong></p>\r\n\r\n<p>The words of which the initial letter is capitalized have meanings defined under the following conditions. The following definitions shall have the same meaning regardless of whether they appear in singular or in plural.</p>\r\n\r\n<p><strong>Definitions</strong></p>\r\n\r\n<p>For the purposes of this Return and Refund Policy:</p>\r\n\r\n<ul>\r\n	<li><strong>Company</strong>&nbsp;(referred to as either &quot;the Company&quot;, &quot;We&quot;, &quot;Us&quot; or &quot;Our&quot; in this Agreement) refers to Lasting Sillage Perfumes Trading LLC, 901, Lake Central Tower, Marasi Drive, Business Bay, Dubai, UAE.</li>\r\n	<li><strong>Goods</strong>&nbsp;refer to the items offered for sale on the Service.</li>\r\n	<li><strong>Orders</strong>&nbsp;mean a request by You to purchase Goods from Us.</li>\r\n	<li><strong>Service</strong>&nbsp;refers to the Website.</li>\r\n	<li><strong>Website</strong>&nbsp;refers to Mawfoor, accessible from&nbsp;<a href=\"https://mawfoor.com/\" target=\"_blank\">https://mawfoor.com</a></li>\r\n	<li><strong>You</strong>&nbsp;means the individual accessing or using the Service, or the company, or other legal entity on behalf of which such individual is accessing or using the Service, as applicable.</li>\r\n</ul>\r\n\r\n<p><strong>Your Order Cancellation Rights</strong></p>\r\n\r\n<p>You are entitled to cancel Your Order within 7 days without giving any reason for doing so.</p>\r\n\r\n<p>The deadline for cancelling an Order is 7 days from the date on which You received the Goods or on which a third party you have appointed, who is not the carrier, takes possession of the product delivered.</p>\r\n\r\n<p>In order to exercise Your right of cancellation, You must inform Us of your decision by means of a clear statement. You can inform us of your decision by:</p>\r\n\r\n<ul>\r\n	<li>By email:&nbsp;customercare@mawfoor.com</li>\r\n</ul>\r\n\r\n<p>We will reimburse You no later than 14 days from the day on which We receive the returned Goods. We will use the same means of payment as You used for the Order, and You will not incur any fees for such reimbursement.</p>\r\n\r\n<p><strong>Conditions for Returns</strong></p>\r\n\r\n<p>In order for the Goods to be eligible for a return, please make sure that:</p>\r\n\r\n<ul>\r\n	<li>The Goods were purchased in the last 7 days</li>\r\n	<li>The Goods are in the original packaging</li>\r\n</ul>\r\n\r\n<p>The following Goods cannot be returned:</p>\r\n\r\n<ul>\r\n	<li>The supply of Goods made to Your specifications or clearly personalized.</li>\r\n	<li>The supply of Goods which according to their nature are not suitable to be returned, deteriorate rapidly or where the date of expiry is over.</li>\r\n	<li>The supply of Goods which are not suitable for return due to health protection or hygiene reasons and were unsealed after delivery.</li>\r\n	<li>The supply of Goods which are, after delivery, according to their nature, inseparably mixed with other items.</li>\r\n</ul>\r\n\r\n<p>We reserve the right to refuse returns of any merchandise that does not meet the above return conditions in our sole discretion.</p>\r\n\r\n<p>Only regular priced Goods may be refunded. Unfortunately, Goods on sale cannot be refunded. This exclusion may not apply to You if it is not permitted by applicable law.</p>\r\n\r\n<p><strong>Returning Goods</strong></p>\r\n\r\n<p>You are responsible for the cost and risk of returning the Goods to Us. You should send the Goods at the following address:</p>\r\n\r\n<p>901, Lake Central Tower, Marasi Drive, Business Bay, Dubai, United Arab Emirates</p>\r\n\r\n<p>We cannot be held responsible for Goods damaged or lost in return shipment. Therefore, We recommend an insured and trackable mail service. We are unable to issue a refund without actual receipt of the Goods or proof of received return delivery.</p>\r\n\r\n<p><strong>Gifts</strong></p>\r\n\r\n<p>If the Goods were marked as a gift when purchased and then shipped directly to you, You&#39;ll receive a gift credit for the value of your return. Once the returned product is received, a gift certificate will be mailed to You.</p>\r\n\r\n<p>If the Goods weren&#39;t marked as a gift when purchased, or the gift giver had the Order shipped to themselves to give it to You later, We will send the refund to the gift giver.</p>\r\n\r\n<p><strong>Contact Us</strong></p>\r\n\r\n<p>If you have any questions about our Returns and Refunds Policy, please contact us:</p>\r\n\r\n<ul>\r\n	<li>By email:&nbsp;customercare@mawfoor.com</li>\r\n</ul>\r\n', NULL, 'Yes', NULL, NULL, NULL, '1', '1', '2022-06-30 21:54:26', '2022-08-08 13:10:39'),
(32, 30, 'Cookies Policy', 'cookies-policy', '', '<p><strong>Cookies Policy</strong></p>\r\n\r\n<p>Last updated: June 30, 2022</p>\r\n\r\n<p>This Cookies Policy explains what Cookies are and how We use them. You should read this policy so You can understand what type of cookies We use, or the information We collect using Cookies and how that information is used.&nbsp;</p>\r\n\r\n<p>Cookies do not typically contain any information that personally identifies a user, but personal information that we store about you may be linked to the information stored in and obtained from Cookies. For further information on how We use, store and keep your personal data secure, see our Privacy Policy.</p>\r\n\r\n<p>We do not store sensitive personal information, such as mailing addresses, account passwords, etc. in the Cookies We use.</p>\r\n\r\n<p><strong>Interpretation and Definitions</strong></p>\r\n\r\n<p><strong>Interpretation</strong></p>\r\n\r\n<p>The words of which the initial letter is capitalized have meanings defined under the following conditions. The following definitions shall have the same meaning regardless of whether they appear in singular or in plural.</p>\r\n\r\n<p><strong>Definitions</strong></p>\r\n\r\n<p>For the purposes of this Cookies Policy:</p>\r\n\r\n<ul>\r\n	<li><strong>Company</strong>&nbsp;(referred to as either &quot;the Company&quot;, &quot;We&quot;, &quot;Us&quot; or &quot;Our&quot; in this Cookies Policy) refers to Lasting Sillage Perfumes Trading LLC, 901, Lake Central Tower, Marasi Drive, Business Bay, Dubai, UAE.</li>\r\n	<li><strong>Cookies</strong>&nbsp;means small files that are placed on Your computer, mobile device or any other device by a website, containing details of your browsing history on that website among its many uses.</li>\r\n	<li><strong>Website</strong>&nbsp;refers to Mawfoor, accessible from&nbsp;<a href=\"https://mawfoor.com/\" target=\"_blank\">https://mawfoor.com</a></li>\r\n	<li><strong>You</strong>&nbsp;means the individual accessing or using the Website, or a company, or any legal entity on behalf of which such individual is accessing or using the Website, as applicable.</li>\r\n</ul>\r\n\r\n<p><strong>The use of the Cookies</strong></p>\r\n\r\n<p><strong>Type of Cookies We Use</strong></p>\r\n\r\n<p>Cookies can be &quot;Persistent&quot; or &quot;Session&quot; Cookies. Persistent Cookies remain on your personal computer or mobile device when You go offline, while Session Cookies are deleted as soon as You close your web browser.</p>\r\n\r\n<p>We use both session and persistent Cookies for the purposes set out below:</p>\r\n\r\n<ul>\r\n	<li><strong>Necessary / Essential Cookies</strong></li>\r\n</ul>\r\n\r\n<p>Type: Session Cookies</p>\r\n\r\n<p>Administered by: Us</p>\r\n\r\n<p>Purpose: These Cookies are essential to provide You with services available through the Website and to enable You to use some of its features. They help to authenticate users and prevent fraudulent use of user accounts. Without these Cookies, the services that You have asked for cannot be provided, and We only use these Cookies to provide You with those services.</p>\r\n\r\n<ul>\r\n	<li><strong>Functionality Cookies</strong></li>\r\n</ul>\r\n\r\n<p>Type: Persistent Cookies</p>\r\n\r\n<p>Administered by: Us</p>\r\n\r\n<p>Purpose: These Cookies allow us to remember choices You make when You use the Website, such as remembering your login details or language preference. The purpose of these Cookies is to provide You with a more personal experience and to avoid You having to re-enter your preferences every time You use the Website.</p>\r\n\r\n<p><strong>Your Choices Regarding Cookies</strong></p>\r\n\r\n<p>If You prefer to avoid the use of Cookies on the Website, first You must disable the use of Cookies in your browser and then delete the Cookies saved in your browser associated with this website. You may use this option for preventing the use of Cookies at any time.</p>\r\n\r\n<p>If You do not accept Our Cookies, You may experience some inconvenience in your use of the Website and some features may not function properly.</p>\r\n\r\n<p>If You&#39;d like to delete Cookies or instruct your web browser to delete or refuse Cookies, please visit the help pages of your web browser.</p>\r\n\r\n<ul>\r\n	<li>For the Chrome web browser, please visit this page from Google:&nbsp;<a href=\"https://support.google.com/accounts/answer/32050\" target=\"_blank\">https://support.google.com/accounts/answer/32050</a></li>\r\n	<li>For the Internet Explorer web browser, please visit this page from Microsoft:&nbsp;<a href=\"http://support.microsoft.com/kb/278835\" target=\"_blank\">http://support.microsoft.com/kb/278835</a></li>\r\n	<li>For the Firefox web browser, please visit this page from Mozilla:&nbsp;<a href=\"https://support.mozilla.org/en-US/kb/delete-cookies-remove-info-websites-stored\" target=\"_blank\">https://support.mozilla.org/en-US/kb/delete-cookies-remove-info-websites-stored</a></li>\r\n	<li>For the Safari web browser, please visit this page from Apple:&nbsp;<a href=\"https://support.apple.com/guide/safari/manage-cookies-and-website-data-sfri11471/mac\" target=\"_blank\">https://support.apple.com/guide/safari/manage-cookies-and-website-data-sfri11471/mac</a></li>\r\n</ul>\r\n\r\n<p>For any other web browser, please visit your web browser&#39;s official web pages.</p>\r\n\r\n<p><strong>More Information about Cookies</strong></p>\r\n\r\n<p>You can learn more about cookies:&nbsp;<a href=\"https://www.freeprivacypolicy.com/blog/cookies/\" target=\"_blank\">Cookies: What Do They Do?</a>.</p>\r\n\r\n<p><strong>Contact Us</strong></p>\r\n\r\n<p>If you have any questions about this Cookies Policy, You can contact us:</p>\r\n\r\n<ul>\r\n	<li>By email:&nbsp;customercare@mawfoor.com</li>\r\n</ul>\r\n', NULL, 'Yes', 'اربك تكست هو اول موقع يسمح لزواره الكرام بتحويل الكتابة العربي الى كتابة مفهومة من قبل اغلب برامج', 'اربك تكست هو اول موقع يسمح لزواره الكرام بتحويل الكتابة العربي الى كتابة مفهومة من قبل اغلب برامج', 'اربك تكست هو اول موقع يسمح لزواره الكرام بتحويل الكتابة العربي الى كتابة مفهومة من قبل اغلب برامج', '1', '1', '2022-06-30 21:56:52', '2022-11-04 17:53:51');

