(1, 1, 104, 'Basic Course', '<h5 class=\"Details\">This course has been specially design to introduce English communication skill as well as to develop your outgoing personality. Here we will teach you how to speak simple English with strong confidence. Those students who have completed their academic courses but unable to get job due to poor confidence lavel. Basic Spoken English and Personality Development Programme will help them to strengthen themselves. This three months session will also help to generate power and faith in you and you will be able to communicate in simple English.<span class=\"Gap\"></span>If you have completed your class 10 or class 12 and preparing yourself for higher studies, Basic Spoken English Course will be the best for you. As our trainer will guid you for your further educatin as well as you will be introduce with the outer world and their activities. BEST OF LUCK.</h5>', '<h4><span class=\"Semi-Bold Orange\">Course Duration</span> : Up to Service</h4>\r\n<h4><span class=\"Semi-Bold Orange\">Timing</span> : 4 Days In A Week</h4>', '<span class=\"Semi-Bold Orange\">Course Structure</span>\r\n<h5 class=\"Structure\"><span><b>1.</b> Introductory Conversation</span>\r\n                <span><b>2.</b> Speech &amp; Debate</span>\r\n                <span><b>3.</b> Group Discussion</span>\r\n                <span><b>4.</b> Personality Development</span>\r\n                <span><b>5.</b> Public Facing</span>\r\n                <span> <b>6.</b> GK &amp; GI</span>\r\n                <span><b>7.</b> Basic Grammar</span>\r\n                <span><b>8.</b> Self introduction</span>\r\n                <span><b>9.</b> Games with English</span>\r\n                <span><b>10.</b> Teaching</span>\r\n                <span><b>11.</b> Quiz</span>\r\n                <span><b>12.</b> Outing</span></h5>', '01.png', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Active', NULL, NULL, '2021-12-30 13:10:56', '2021-12-30 13:10:56'),
(2, 1, 103, 'Advance Course', '<h5 class=\"Details\">This course has been specially design to introduce English communication skill as well as to develop your outgoing personality. Here we will teach you how to speak simple English with strong confidence. Those students who have completed their academic courses but unable to get job due to poor confidence lavel. Basic Spoken English and Personality Development Programme will help them to strengthen themselves. This three months session will also help to generate power and faith in you and you will be able to communicate in simple English.<span class=\"Gap\"></span>If you have completed your class 10 or class 12 and preparing yourself for higher studies, Basic Spoken English Course will be the best for you. As our trainer will guid you for your further educatin as well as you will be introduce with the outer world and their activities. BEST OF LUCK.</h5>', '<h4><span class=\"Semi-Bold Orange\">Course Duration</span> : 3 Months</h4>\r\n<h4><span class=\"Semi-Bold Orange\">Timing</span> : 3 Days In A Week</h4>', '<h3 class=\"Structure-Head\"><span class=\"Semi-Bold Orange\">Course Structure</span></h3>\r\n<h5 class=\"Structure\"><span><b>1.</b> Communication Skill</span>\r\n                <span><b>2.</b> Group Discussion</span>\r\n                <span><b>3.</b> Speech &amp; Debate</span>\r\n                <span><b>4.</b> Interview Training</span>\r\n                <span><b>5.</b> Movement</span>\r\n                <span><b>6.</b> Quiz</span>\r\n                <span><b>7.</b> Soft Skill</span>\r\n                <span><b>8.</b> Teaching</span>\r\n                <span><b>9.</b> Outing</span>\r\n                <span><b>10.</b> GK &amp; GI</span>\r\n                <span><b>11.</b> Basic Grammar</span>\r\n                <span><b>12.</b> IPA / MTI</span>\r\n                <span><b>13.</b> Public Facing</span>\r\n                <span><b>14.</b> Body Language</span>\r\n                <span><b>15.</b> Personality Development</span>\r\n                <span><b>16.</b> Tele Communication</span>\r\n                <span><b>17.</b> Games with English</span>\r\n                <span><b>18.</b> Phonetic Development</span>\r\n                <span><b>19.</b> Voice Modulation</span></h5>', '02.png', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Active', NULL, NULL, '2021-12-30 13:19:18', '2021-12-30 13:19:18'),
(4, 1, 105, 'Combined Course', '<h5 class=\"Details\">This course has been specially design to introduce English communication skill as well as to develop your outgoing personality. Here we will teach you how to speak simple English with strong confidence. Those students who have completed their academic courses but unable to get job due to poor confidence lavel. Basic Spoken English and Personality Development Programme will help them to strengthen themselves. This three months session will also help to generate power and faith in you and you will be able to communicate in simple English.<span class=\"Gap\"></span>If you have completed your class 10 or class 12 and preparing yourself for higher studies, Basic Spoken English Course will be the best for you. As our trainer will guid you for your further educatin as well as you will be introduce with the outer world and their activities. BEST OF LUCK.</h5>', '<h4><span class=\"Semi-Bold Orange\">Course Duration</span> : Up to Service</h4>\r\n<h4><span class=\"Semi-Bold Orange\">Timing</span> : 4 Days In A Week</h4>', '<h3 class=\"Structure-Head\"><span class=\"Semi-Bold Orange\">Course Structure</span></h3>\r\n<h5 class=\"Structure\"><span><b>1.</b> Conversational English</span>\r\n                <span><b>2.</b> Speech &amp; Debate</span>\r\n                <span><b>3.</b> Group Discussion</span>\r\n                <span><b>4.</b> Basic Grammer</span>\r\n                <span><b>5.</b> Personality Development</span>\r\n                <span><b>6.</b> Interview training</span>\r\n                <span><b>7.</b> GK &amp; GI</span>\r\n                <span><b>8.</b> Quiz Programme</span>\r\n                <span><b>9.</b> Public Facing</span>\r\n                <span><b>10.</b> Teaching</span>\r\n                <span><b>11.</b> Games in English</span>\r\n                <span><b>12.</b> Movement</span>\r\n                <span><b>13.</b> Phonetic Development</span>\r\n                <span><b>14.</b> IPA</span>\r\n                <span><b>15.</b> Soft Skill</span>\r\n                <span><b>16.</b> Outing</span>\r\n                <span><b>17.</b> Computer Literacy</span>\r\n                <span><b>18.</b> Internet Application</span>\r\n                <span><b>19.</b> Voice Technology</span>\r\n                <span><b>20.</b> Tele Communication</span></h5>', '03.png', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Active', NULL, NULL, '2021-12-30 13:19:18', '2021-12-30 13:19:18'),
(5, 1, 219, 'Call Centre/BPO', '<h5 class=\"Details\">ADVANCE SPOKEN ENGLISH & COMMUNICATION SKILL</h5>', '<h4><span class=\"Semi-Bold Orange\">Course Duration</span> : Up to Service</h4>\r\n<h4><span class=\"Semi-Bold Orange\">Timing</span> : 4 Days In A Week</h4>', '<h3 class=\"Structure-Head\"><span class=\"Semi-Bold Orange\">Course Structure</span></h3>\r\n<h5 class=\"Structure\"><span><b>1.</b> Conversational English</span>\r\n                <span><b>2.</b> Speech &amp; Debate</span>\r\n                <span><b>3.</b> Group Discussion</span>\r\n                <span><b>4.</b> Basic Grammer</span>\r\n                <span><b>5.</b> Personality Development</span>\r\n                <span><b>6.</b> Interview training</span>\r\n                <span><b>7.</b> GK &amp; GI</span>\r\n                <span><b>8.</b> Quiz Programme</span>\r\n                <span><b>9.</b> Public Facing</span>\r\n                <span><b>10.</b> Teaching</span>\r\n                <span><b>11.</b> Games in English</span>\r\n                <span><b>12.</b> Movement</span>\r\n                <span><b>13.</b> Phonetic Development</span>\r\n                <span><b>14.</b> IPA</span>\r\n                <span><b>15.</b> Soft Skill</span>\r\n                <span><b>16.</b> Outing</span>\r\n                <span><b>17.</b> Computer Literacy</span>\r\n                <span><b>18.</b> Internet Application</span>\r\n                <span><b>19.</b> Voice Technology</span>\r\n                <span><b>20.</b> Tele Communication</span></h5>', '03.png', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Active', NULL, NULL, '2021-12-30 13:19:18', '2021-12-30 13:19:18'),
(6, 1, 220, 'Kid Section', '<h5 class=\"Details\">We Focuses on developing the four English language skills: Reading, Writing, Listening and Speaking. We build the cornerstones of language, Grammar and Vocabulary, from a young age. This course for kids includes methodology such as teaching pronunciation and materials preparation. The Stages learning to correlate with brain growth in children to allow for the optimum time to present materials and establish cognitive links in the brain.<span class=\"Gap\"></span>We are best in this field because:<span class=\"Gap\"></span>\r\n<li>Fun – Students enjoy their English Language Programs at Smart Education.</li>\r\n<li>We Get Results – Our students are systematically prepared to cover every aspect of the English language.</li>\r\n<li>Caring Teachers – Our dedicated teachers are carefully selected not only for their English Language teaching qualifications and experience, but also for their warm and caring approach</li>\r\n<li>Atmosphere – Our clean and safe classes have been specifically designed with kids in mind. ‘English-only’ is required throughout our facility.</li>\r\n<li>Library – Our library is well stocked with a vast assortment of quality imported books, suitable for varying reading levels, all in support of our English courses.</li>\r\n<li>Reading Program – All English Language students are required to read at their respective reading levels building a regular reading hobby, as well as skills to become more effective readers (and ultimately writers).</li>\r\n<span class=\"Gap\"></span>Your child will need to take a placement test. This is to gauge your child’s level of English and place him/her at a level where he/she will learn best. To arrange an appointment or to take admission please contact our centres.\r\n</h5>', '<h4><span class=\"Semi-Bold Orange\">Course Duration</span> : Up to Service</h4>\r\n<h4><span class=\"Semi-Bold Orange\">Timing</span> : 4 Days In A Week</h4>', '<h3 class=\"Structure-Head\"><span class=\"Semi-Bold Orange\">Course Structure</span></h3>\r\n<h5 class=\"Structure\"><span><b>1.</b> Conversational English</span>\r\n                <span><b>2.</b> Speech &amp; Debate</span>\r\n                <span><b>3.</b> Group Discussion</span>\r\n                <span><b>4.</b> Basic Grammer</span>\r\n                <span><b>5.</b> Personality Development</span>\r\n                <span><b>6.</b> Interview training</span>\r\n                <span><b>7.</b> GK &amp; GI</span>\r\n                <span><b>8.</b> Quiz Programme</span>\r\n                <span><b>9.</b> Public Facing</span>\r\n                <span><b>10.</b> Teaching</span>\r\n                <span><b>11.</b> Games in English</span>\r\n                <span><b>12.</b> Movement</span>\r\n                <span><b>13.</b> Phonetic Development</span>\r\n                <span><b>14.</b> IPA</span>\r\n                <span><b>15.</b> Soft Skill</span>\r\n                <span><b>16.</b> Outing</span>\r\n                <span><b>17.</b> Computer Literacy</span>\r\n                <span><b>18.</b> Internet Application</span>\r\n                <span><b>19.</b> Voice Technology</span>\r\n                <span><b>20.</b> Tele Communication</span></h5>', '03.png', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Active', NULL, NULL, '2021-12-30 13:19:18', '2021-12-30 13:19:18'),
(7, 1, 221, 'Professional Course', '<h5 class=\"Details\">SPOKEN ENGLISH & PERSONALITY DEVELOPMENT COURSE<span class=\"Gap\"></span>If you are A BUSY PROFESSIONAL and have no time to join full time course, so you can join our professional batch. Maximum students in this batch belong to various field and has left studies years back. we train them from the beginning and also help to do their studies OVER PHONE. Here people feel quite comfortable and relax as they no need to face other junior students. Many doctors, professors, teachers, businessmen, company mangers, and also many job seekers are enjoying their studies and being benefited in their personal and professional life.</h5>', '<h4><span class=\"Semi-Bold Orange\">Course Duration</span> : 3 Months</h4>\r\n<h4><span class=\"Semi-Bold Orange\">Timing</span> : 3 Days In A Week</h4>', '<h3 class=\"Structure-Head\"><span class=\"Semi-Bold Orange\">Course Structure</span></h3>\r\n<h5 class=\"Structure\"><span><b>1.</b> Grammar Practice</span>\r\n                <span><b>2.</b> Public Speaking</span>\r\n                <span><b>3.</b> Group Discussions</span>\r\n                <span><b>4.</b> Role-Plays</span>\r\n                <span><b>5.</b> Personality Development</span>\r\n                <span><b>6.</b> Communication Skills</span>\r\n                <span><b>7.</b> Presentation Skills</span>\r\n                <span><b>8.</b> Business English</span>\r\n                <span><b>9.</b> Attitude Training</span>\r\n                <span><b>10.</b>Body Language</span>\r\n                <span><b>11.</b>Time Management</span>\r\n                <span><b>12.</b> Interview Skills</span>\r\n                <span><b>13.</b> Interview Training Video</span>\r\n                <span><b>14.</b> Voice & Accent</span>\r\n                <span><b>15.</b> Video Recording</span>\r\n                <span><b>16.</b> Email Drafting etc.</span>\r\n                </h5>', '02.png', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Active', NULL, NULL, '2021-12-30 13:19:18', '2021-12-30 13:19:18'),
(8, 1, 222, 'Bengali & Hindi Medium', '<h5 class=\"Details\">Smart Education offers a wide range of English Language, Soft Skills, Sales & Service and Communication training programs designed to help students and others especially who are from Bengali and Hindi medium realize their true potential and allow them to achieve its goals.<span class=\"Gap\"></span>Our Spoken English Classes available for those Students, Executives, Housewives who are really suffering with the same problem that they are belonging from Bengali or Hindi medium schools.<span class=\"Gap\"></span><li>We use world class content.</li>\r\n<li>Our Trainers are certified English Language trainers having corporate training experience.</li>\r\n<li>Cost Effective, Result Oriented training.</li>\r\n<li>Audio / Video, Multimedia blended learning</li>\r\n<li>LOTS of FUN!!!</li>\r\n<span class=\"Gap\"></span>\r\nOur all type of course structures has been prepared as per the demand of the Bengali and Hindi medium background student. We welcome all this type of people who fear to join or take admission in any professional course. We understand your problem, don’t be nervous and fell free. Please come here, join with us and feel the changes in yourself.\r\n</h5>', '<h4><span class=\"Semi-Bold Orange\">Course Duration</span> : 3 Months</h4>\r\n<h4><span class=\"Semi-Bold Orange\">Timing</span> : 3 Days In A Week</h4>', '', '02.png', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Active', NULL, NULL, '2021-12-30 13:19:18', '2021-12-30 13:19:18'),
(9, 1, 223, 'Bengali & Hindi Medium', '<h5 class=\"Details\">ADVANCE SPOKEN ENGLISH & COMMUNICATION SKILL<span class=\"Gap\"></span>Coming Soon…\r\n</h5>', '<h4><span class=\"Semi-Bold Orange\">Course Duration</span> : 3 Months</h4>\r\n<h4><span class=\"Semi-Bold Orange\">Timing</span> : 3 Days In A Week</h4>', '', '02.png', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Active', NULL, NULL, '2021-12-30 13:19:18', '2021-12-30 13:19:18'),
